(11872, '4', '480', '20170919-480Setting Gmail di Thunderbird.mp4', 'jfif', 'Setting Gmail di Thunderbird', 'Thunderbird adalah aplikasi mail client (MUA - Mail User Agent) yang fungsinya sama dengan Outlook Express, Eudora Mail, Evolution, Sylpheed, dan sejenisnya. Thunderbird ini adalah salah satu produk turunan dari Mozilla. Pada awalnya Mozilla selalu mengemas aplikasinya dengan Browser + Mail Client. Namun, Mozilla mencoba memecah produknya dan membuatnya jauh lebih menarik dan ringan. Project Browsernya bernama: FireFox, dimana Project Mail Client-nya bernama: Thunderbird. Thunderbird diproduksi untuk beberapa operating system, antara lain: Windows, Linux (Unix), atau MacosX. Thunderbird mempunyai kemampuan untuk berganti-ganti themes, dan dapat ditambahkan dengan plugin. Thunderbird juga bisa melakukan import setting dan mail dari Outlook Express, Mozilla / Netscape. Thunderbird bisa berfungsi sebagai RSS feeder, yaitu untuk membaca atau melakukan cek blog ala RSS.', 'setting gmail, thunderbird, setting gmail di thunderbird', '20170929-email.jfif', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '57', NULL, 'setting-gmail-di-thunderbird', NULL, NULL, NULL),
