(12063, '10', '66', '20171006-66SimplePlanes 2017-10-06 11-13-36-173_x264.mp4', 'mp4', 'N-219 Military', 'N-219 adalah pesawat multi fungsi bermesin dua yang dirancang oleh PT Dirgantara Indonesia (PT DI) dengan tujuan untuk dioperasikan di daerah-daerah terpencil. Pesawat ini terbuat dari logam dan dirancang untuk mengangkut penumpang maupun kargo. Pesawat yang dibuat dengan memenuhi persyaratan FAR 23 ini dirancang memiliki volume kabin terbesar di kelasnya dan pintu fleksibel yang memastikan bahwa pesawat ini bisa dipakai untuk mengangkut penumpang dan juga kargo.\r\n\r\nSebelum memasuki serial production, PT DI terlebih dahulu akan membuat dua unit purwarupa untuk uji terbang serta satu unit purwarupa untuk tes statis pada tahun 2012. Program pembuatan purwarupa sendiri direncanakan memakan waktu selama dua tahun dengan pengalokasian dana yang dibutuhkan sebesar Rp. 300 miliar.[2]\r\n\r\nN-219 akan melakukan uji terbang di laboratorium uji terowongan angin pada bulan Maret 2010. Pesawat N-219 baru akan bisa diserahkan kepada pemesan pertamanya untuk diterbangkan sekitar 2014-2015. N-219 ini merupakan pengembangan dari NC-212 yang sudah diproduksi oleh PT DI dibawah lisensi CASA.', 'pesawat', '20171006-n-219.jpg', '<a href=\"index.php?r=site/play&amp;id=11624\">http://ensiklomedia.kemdikbud.go.id/web/index.php?r=site/play&amp;id=11624<br />http://ensiklomedia.kemdikbud.go.id/web/index.php?r=site/play&amp;id=12075</a><br />\r\n<p><br /><br /></p>', NULL, NULL, NULL, '<p><a href=\"https://id.wikipedia.org/wiki/N-219\">https://id.wikipedia.org/wiki/N-219</a><br /><br /><br /><img src=\"http://beritatrans.com/cms/wp-content/uploads/2017/08/n219.jpg\" /><br /><br />merancang pesawat dengan aplikasi simpleplanes</p>\r\n<p><a href=\"https://www.simpleplanes.com/a/0BGfDc/N-219-Bomber-Version\">https://www.simpleplanes.com/a/0BGfDc/N-219-Bomber-Version</a></p>\r\n<p>download aplikasi di <a href=\"http://gg.gg/simpleplanes1520\">http://gg.gg/simpleplanes1520</a></p>', NULL, NULL, NULL, NULL, 1, '96', NULL, 'n-219-military', NULL, NULL, NULL),
