(12075, '4', '66', '20171009-66ifx fight_x264.mp4', 'mp4', 'Pesawat KFX/IFX (Indonesia Fighter Experiment) ', 'Jet tempur KFX/IFX adalah pesawat semi siluman generasi 4.5 yang dikembangkan Korea Selatan dan Indonesia. Kerjasama pengembangan pesawat ini sebatas pada pengembangan pesawat hingga mencapai prototipe. Dari enam prototipe yang akan dihasilkan, satu prototipe akan diserahkan pada Indonesia. Saat ini program Engineering Manufacture Development (EMD) telah menyelesaikan 14 persen dari keseluruhan perencanaan program yang berlangsung hingga 2026.\r\n', 'Pesawat Tempur, stealth, n-219 military', '20171007-ifx stealth.jpg', '<p><a href=\"index.php?r=site%2Froomsearch&amp;title=n-219\">http://ensiklomedia.kemdikbud.go.id/web/index.php?r=site%2Froomsearch&amp;title=n-219</a></p>\r\n<p><a href=\"index.php?r=site/play&amp;id=11624\">http://ensiklomedia.kemdikbud.go.id/web/index.php?r=site/play&amp;id=11624</a><br /><br /><br /></p>', NULL, NULL, 'Sumber https://nasional.tempo.co/read/895226/jet-tempur-kfxifx-mengadopsi-4-teknologi-eropa#TlobZbOmdOFpOAAO.99', '<p>Sumber <a href=\"https://nasional.tempo.co/read/895226/jet-tempur-kfxifx-mengadopsi-4-teknologi-eropa#TlobZbOmdOFpOAAO.99\">https://nasional.tempo.co/read/895226/jet-tempur-kfxifx-mengadopsi-4-teknologi-eropa#TlobZbOmdOFpOAAO.99<br /><br /></a><a href=\"https://nasional.tempo.co/read/895226/jet-tempur-kfxifx-mengadopsi-4-teknologi-eropa#TlobZbOmdOFpOAAO.99\">http://radarmiliter.blogspot.co.id/2016/01/pt-di-akan-produksi-50-unit-jet-tempur.html</a><a href=\"https://nasional.tempo.co/read/895226/jet-tempur-kfxifx-mengadopsi-4-teknologi-eropa#TlobZbOmdOFpOAAO.99\"><br /><br /><br /><img src=\"http://4.bp.blogspot.com/-RugC96bPEBo/Vo5zjMe7LuI/AAAAAAAAB-w/estnwk57EIU/s1600/20160107_17.jpg\" /><br /><br /><br /></a></p>\r\n<p>aplikasi game edukatif merancang pesawat <a href=\"https://nasional.tempo.co/read/895226/jet-tempur-kfxifx-mengadopsi-4-teknologi-eropa#TlobZbOmdOFpOAAO.99\">https://www.simpleplanes.com/a/Y8