(12101, '1', '616', '20171011-616VEGETATIF ALAMI video pembelajaran_22222222.mp4', 'jpg', 'VEGETATIF ALAMI', 'Perkembangbiakan yang terjadi tanpa proses perkawinan disebut perkembangbiakan secara vegetatif. Perkembangbiakan secara vegetatif dapat terjadi melalui dua cara. Jika perkembangbiakan vegetatifnya terjadi tanpa campur tangan manusia, disebut vegetatif alami. Adapun perkembangbiakan vegetatif yang terjadi dengan campur tangan manusia, disebut vegetatif buatan.', 'perkembangbiakan tumbuhan secara vegetatif alami antara lain:tunas, geragih, umbi, spora dan rhizoma', '20171013-Rhizoma.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '71', NULL, 'vegetatif-alami', NULL, NULL, NULL),
