(12110, '10', '66', '20171013-66VID-20171013-WA0009.mp4', 'jpg', 'Scramjet', 'Scramjet (s upersonic c ombustion ramjet) adalah varian dari mesin “ramjet airbreathing” dimana pembakaran terjadi di aliran udara supersonic.\r\nMesin scramjet adalah jenis mesin jet, dan bergantung pada pembakaran bahan bakar dan senyawa oksidator untuk menghasilkan daya dorong. Mirip dengan mesin jet konvensional, suplai tenaga scramjet bersumber dari bahan bakar yang dibawa pesawat, dan memperoleh oksidator oleh konsumsi oksigen atmosfer (dibandingkan dengan roket, yang membawa kedua bahan bakar dan agen oksidasi yaitu hydrogen dan oksigen). Persyaratan ini membatasi scramjet hanya untuk penerbangan suborbital atmosfer, di mana kandungan oksigen dari udara cukup untuk proses  pembakaran.\r\nMesin scramjet dirancang untuk menjadi penggerak pesawat hipersonik atau berkecepatan di atas 5 mach. Berbeda dengan mesin roket, pesawat bermesin scramjet tidak perlu membawa oksigen pembakar bahan bakar (fuel) karena kebutuhan oksigen diambil dari udara bebas. Dengan tanpa harus membawa oksigen, beban terbang pesawat akan lebih ringan. Ini memungkinkan pesawat dapat bergerak lebih cepat atau memiliki ruang angkut lebih lapang.\r\n\r\n\r\n', 'jet, pesawat tempur, pesawat', '20171013-scramjet.jpg', 'FA-37 TALON SCRAMJET&nbsp;<a href=\"https://www.youtube.com/watch?v=ZQWNo6qyl2Q\">https://www.youtube.com/watch?v=ZQWNo6qyl2Q<br /></a>', NULL, NULL, NULL, '<div class=\"containertabs\">\r\n<div class=\"tab-content\">\r\n<div id=\"menu5\" class=\"tab-pane fade active in\">\r\n<p>Sumber :&nbsp;<a href=\"https://id.wikipedia.org/wiki/Scramjet\">https://id.wikipedia.org/wiki/Scramjet</a>&nbsp;</p>\r\n<p>Skema Scramjet:&nbsp;<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/22/Scramjet_operation_en.svg/600px-Scramjet_operation_en.svg.png\" /></p>\r\n<p>aplikasi game edukatif merancang pesawat&nbsp;<a href=\"https://www.simpleplanes.com/a/vHfSij/RangKong-MK-II-REPOST\">https://www.simpleplanes.com/a/vHfSij/RangKong-MK-II-REPOST</a><br /><br /><br /><br />download aplikasi di&nbsp;<a href=\"http://gg.gg/simpleplanes/1520\">http://gg.gg/simpleplanes/1520</a></p>\r\n</div>\r\n</div>\r\n</div>', NULL, NULL, NULL, NULL, 1, '84', NULL, 'scramjet', NULL, NULL, NULL),
