(12162, '18', '626', '20171020-626TANDA-TANDA KIAMAT.mp4', 'mp4', 'TANDA-TANDA KIAMAT by SUHERNI', 'Hari kiamat adalah hari berakhirnya seluruh proses kehidupan mahluk hidup didunia. Kiamat pasti terjadi tapi tidak seorang pun yang tahu termasuk para nabi dan raul kapan terjadinya kiamat. Rasulullah SAW memberitahukan kepada kita beberapa tanda kiamat yang disebut dengan tanda-tanda kecil (\'alamat sughra) dan tanda-tanda besar (\'alamat qubhra). Video ini menayangkan tanda-tanda kiamat (\'alamat sughra) yang sudah terjadi.', 'kiamat, tanda-tanda', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '41', NULL, 'tanda-tanda-kiamat-by-suherni', NULL, NULL, NULL),
