(12167, '9', '626', '20171022-626TANDA-TANDA KIAMAT.mp4', 'mp4', 'Tanda Tanda Kiamat ', 'Hari kiamat adalah hari berakhirnya seluruh proses kehidupan makhluk hidup di dunia. Kiamat pasti akan terjadi, tapi tidak seorang pun yang tahu termasu para Nabi dan Rasul kapan akan terjadi. Rasulullah SAW memberitahukan kepada kita beberapa tanda-tanda kiamat, yang disebut dengan tanda-tanda kecil (\"alamat sughra) dan Tanda-tanda besar (\"alamat kubra).Berikut adalah tanda-tanda kiamat kecil (\"alamat sughra) yang sudah terjadi.', 'Tanda - tanda kiamat', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '32', NULL, 'tanda-tanda-kiamat', NULL, NULL, NULL),
(12168, '12', '626', '20171022-626TANDA-TANDA KIAMAT.mp4', 'mp4', 'Tanda Tanda Kiamat ', 'Hari kiamat atau hari akhir adalah hari berakhirnya seluruh proses kehidupan mahluk hidup di dunia. Hari kiamat pasti akan datang, tetapi tidak ada suatu mahlukpun bahkan para nabi dan rasul pun yang dapat mengetahui kapan datangnya. Tanda-tanda kiamat terbagi atas dua yaitu tanda-tanda kiamat sugro (\'alamatul sugro) dan tanda-tanda kiamat qubra (\'alamatul qubro). Tanda-tanda kiamat sugro sudah nampak, dalam tayangan video ini menunjukkan tanda-tanda kiamat sugro yang terjadi saat ini.', 'tanda tanda, kiamat', '20171022-COVER TANDA TANDA KIAMAT.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '68', NULL, 'tanda-tanda-kiamat-2', NULL, NULL, NULL),
(12169, '6', '606', '20171024-606PENCERNAAN_MAKANAN_PADA_MANUSIA_REVISI.mp4', 'png', 'PENCERNAAN MAKANAN PADA MANUSIA ', 'Video Pencernaan Makanan Pada Manusia merupakan video pembelajaran yang disusun berdasarkan  buku BSE dan dilengkapi dengan gambar dan video yang melengkapi proses sehingga siswa akan memiliki pemahaman yang jelas tentang alat-alat pencernaan makanan pada manusia.', 'Pencernaan Makanan Pada Manusia ', '20171024-vlcsnap-error674.png', NULL, NULL, NULL, NULL, 'Azmiyati,dkk.(2008). <em>IPA Saling Temas untuk Kelas V SD/MI</em>. Jakarta : Pusat Perbukuan, Departement&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Pendidikan Nasional.<br />Priyono, Amin.(2008). <em>Ilmu Pengetahuan Alam 5 : untuk SD/MI Kelas V</em>. Jakarta : Pusat Perbukuan,&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Departemen Pendidikan Nasional.<br />Sulistyanto, Heri.(2008).<em>Ilmu Pengetahuan Alam 5 : untuk sd Kelas v.</em> Jakarta : Pusat Perbukuan, Departemen Penddidikan Nasional&nbsp;', NULL, NULL, NULL, NULL, 1, '261', NULL, 'pencernaan-makanan-pada-manusia', NULL, NULL, NULL),
