(12181, '6', '66', '20171025-66horten_0002_x264.mp4', 'jpg', 'Pesawat Siluman PD II', 'Pada awal 1930an, Horten bersaudara telah tertarik pada desain sayap terbang sebagai metode untuk meningkatkan kinerja glider. Pemerintah Jerman mendanai klub glider pada saat itu karena produksi pesawat militer dan bahkan pesawat terbang dilarang oleh Perjanjian Versailles setelah Perang Dunia I. Tata letak sayap terbang menghapus permukaan yang \"tidak dibutuhkan\" dan secara teoritis menawarkan bobot serendah mungkin, dengan menggunakan sayap yang relatif pendek dan kokoh, dan tanpa tambahan drag dari badan pesawat. Hasilnya adalah Horten H.IV. \r\n\r\nPada tahun 1943, Reichsmarschall Göring mengeluarkan permintaan untuk proposal desain untuk menghasilkan sebuah bomber yang mampu membawa muatan 1.000 kilogram (2.200 lb) di atas 1.000 kilometer (620 mil) pada jarak 1.000 kilometer per jam (620 mph); apa yang disebut \"proyek 3 × 1000\". Pembom konvensional Jerman bisa mencapai pusat komando Sekutu di Inggris Raya, namun menderita kerugian yang menghancurkan dari pejuang Sekutu. [3] Pada saat itu, tidak ada cara untuk memenuhi tujuan ini - turbojet Junkers Jumo 004B yang baru dapat memberikan kecepatan yang dibutuhkan, namun memiliki konsumsi bahan bakar yang berlebihan.\r\n\r\nHortens menyimpulkan bahwa desain sayap terbang rendah bisa memenuhi semua tujuan: dengan mengurangi hambatan, daya jelajah dapat diturunkan sampai pada titik di mana persyaratan jangkauan dapat dipenuhi. Mereka mengajukan proyek pribadi mereka, H.IX, sebagai basis pembom. Kementerian Udara Pemerintah (Reichsluftfahrtministerium) menyetujui usulan Horten tersebut, namun memerintahkan penambahan dua meriam 30 mm, karena mereka merasa pesawat terbang juga berguna sebagai pesawat tempur karena perkiraan kecepatan tertinggi lebih tinggi daripada pesawat Sekutu manapun.\r\n\r\nH.IX terbuat dari konstruksi campuran, dengan polong pusat yang terbuat dari pipa baja dilas dan spar sayap yang dibangun dari kayu. Sayap terbuat dari dua panel kayu lapis tipis yang diresapi karbon yang direkatkan dengan campuran arang dan serbuk gergaji. Sayap memiliki satu tiang utama tunggal, ditembus oleh inlet mesin jet, dan tiang sekunder yang digunakan untuk memasang langit-langit. Ini dirancang dengan faktor beban 7g dan rating keamanan 1,8 ×; Oleh karena itu, pesawat memiliki rating beban utama 12.6g. Perbandingan chord / ketebalan sayap berkisar antara 15% pada akar sampai 8% pada ujung sayap.  Pesawat tersebut menggunakan landing gear roda tiga yang dapat ditarik, dengan nosegear pada dua prototipe pertama yang bersumber dari sistem tailwheel He 177, dengan prototipe ketiga menggunakan roda gigi dan roda gigi utama 177A pada roda kemudi dan garpu garpu yang dirancang khusus. Sebuah parasut drogue memperlambat pesawat saat mendarat. Pilot duduk di kursi ejeksi primitif. Setelan tekanan khusus dikembangkan oleh Dräger. Pesawat ini awalnya dirancang untuk mesin jet BMW 003, namun mesinnya belum siap, dan mesin Junkers Jumo 004 diganti. \r\n\r\nKontrol dicapai dengan elevons dan spoiler. Sistem kontrol mencakup spoiler long-span (inboard) dan short-span (tempel), dengan spoiler tempel yang lebih kecil diaktifkan terlebih dahulu. Sistem ini memberikan kontrol yang lebih halus dan anggun dari yaw daripada sistem single-spoiler. ', 'stealth, pesawat, pesawat tempur, ', '20171025-horten.jpg', NULL, NULL, NULL, NULL, '<a href=\"http://www.bbc.com/indonesia/vert_fut/2016/04/160413_vert_fut_pesawat_ww2\">http://www.bbc.com/indonesia/vert_fut/2016/04/160413_vert_fut_pesawat_ww2<br /><br />http://siradel.blogspot.co.id/2012/08/pesawat-siluman-nazi-horten-ho-229.html<br /></a><br /><img src=\"http://home.planet.nl/~otten100/images/strip6s.jpg\" /><br /><a href=\"https://thechive.files.wordpress.com/2015/07/restoring-the-horten-229-v3-flying-wing-42.jpg?quality=85&amp;strip=info&amp;w=920\"><br /></a>', NULL, NULL, NULL, NULL, 1, '65', NULL, 'pesawat-siluman-pd-ii', NULL, NULL, NULL),
(12182, '12', '909', '20171025-909Pengholongan Hewan Berdasarkan Makanannya.mp4', 'png', 'Penggolongan   Hewan Berdasarkan Jenis Makanannya', 'Hewan dapat  digolongkan berdasarkan jenis makanannya, meliputi :\r\n1. Herbivora adalah jenis hewan yang memakan makanan yang berasal dari tumbuhan. Misalnya sapi, kambing, kelinci, dan sebagainya.\r\n2. Karnivora adalah jenis hewan yang memakan makanan yang berasal dari daging. Misalnya elang, buaya, serigala, dan sebagainya.\r\n3, Omnivora adalah  hewan yang memakan makanan yang berasal dari tumbuhan dan daging. Misalnya ayam, bebek, beruang, dan sebagainya.', '', '20171026-Video.png', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 1, '75', NULL, 'penggolongan-hewan-berdasarkan-jenis-makanannya', NULL, NULL, NULL),
