(12186, '6', '66', '20171027-66SimplePlanes 2017-10-27 16-26-47-391_x264.mp4', 'jpg', 'Pesawat Terbang Pertama', 'Sejak dahulu banyak orang yang menganggap manusia bisa terbang di udara merupakan hal tidak mungkin dan susah diwujudkan, bahkan banyak yang menertawakan ide tersebut. Namun setelah penemuan pesawat terbang oleh Wright Bersaudara, hal tersebut kemudian menjadi kenyataan.\r\n\r\nAdalah Wright bersaudara (Wright brothers) yang lahir pada tanggal 19 Agustus 1871 dan wafat 30 January 1948 kemudian saudaranya Wilbur yang lahir pada 16 April 1867 dan wafat 30 May 1912 adalah dua orang Amerika yang dicatat dunia  sebagai penemu pesawat terbang.\r\n\r\nMereka berhasil membangun pesawat terbang yang pertama kali berhasil diterbangkan dan dikendalikan oleh manusia pada tanggal 17 Desember 1903. Dua tahun setelah penemuan mereka, kedua bersaudara tersebut mengembangkan ‘mesin terbang’ mereka ke bentuk pesawat terbang yang memakai sayap yang seperti sekarang kita kenal.', 'pesawat ', '20171027-wright plane.jpg', NULL, NULL, NULL, NULL, '<a href=\"http://www.penemu.co/penemu-pesawat-terbang/\">http://www.penemu.co/penemu-pesawat-terbang/<br /><br /></a>', NULL, NULL, NULL, NULL, 1, '53', NULL, 'pesawat-terbang-pertama', NULL, NULL, NULL),
(12187, '13', '66', '20171027-66SimplePlanes 2017-10-27 20-11-39-419_x264.mp4', 'jpg', 'Pesawat Tempur pertama (RAF F.E.2b)', 'The Airco DH.2 adalah pesawat \"pendorong\" biplan satu kursi yang dioperasikan sebagai pejuang selama Perang Dunia Pertama. Itu adalah desain pendorong kedua oleh Geoffrey de Havilland untuk Airco, berdasarkan pada sebelumnya DH.1 dua tempat duduknya. DH.2 adalah pesawat tempur single-seat pertama yang dipersenjatai secara efektif dan memungkinkan pilot Royal Flying Corps (RFC) untuk melawan \"Fokker Scourge\" yang telah memberi Jerman keuntungan di udara pada akhir 1915. Sampai Inggris mengembangkan sebuah sinkronisasi Peralatan yang sesuai dengan sistem Jerman, alat pengantar seperti DH.2 dan FE2b menanggung beban pertempuran dan tugas pendamping.', 'pesawat, pesawat tempur, pesawat biplane', '20171027-pesawat tempur pertama.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '50', NULL, 'pesawat-tempur-pertama-raf-fe2b', NULL, NULL, NULL),
(12188, '1', '66', '20171027-66SimplePlanes 2017-10-27 20-19-08-127_x264.mp4', 'jpg', 'Pesawat Triplane (Red Baron)', 'Pada awalnya pesawat digunakan untuk mengintai posisi lawan di garis depan serta kepentingan komunikasi, karena sering berpapasan dengan pesawat lawan, maka pilot menggunakan pistol atau senapan untuk saling menembak. Kemudian pesawat dilengkapi dengan senapan mesin dan penembak (gunner) yang ditempatkan di belakang pilot. Posisi gunner sendiri pada awanya ada yang berkemampuan untuk menembak pesawat musuh dibelakangnya, atau didepannya.\r\n\r\nAdalah Roland Garros, seorang penerbang Perancis yang membuat pesawat tempur yang dilengkapi senapan mesin langsung dikendalikan oleh pilot sehingga hanya dibutuhkan satu penerbang saja. Mulanya dipasang senapan mesin pada kokpit pesawat Morane Saulnier. Kemudian digunakan untuk menembaki pesawat pesawat Jerman. Pilot-pilot Jerman terkejut karena saat itu baru pertama kali ada pesawat tempur dapat menyerang dari belakang pesawat lawan dengan satu orang pilot. Masalah muncul pada Roland Garros karena peluru mengenai baling baling dan dapat menghancurkannya. Untuk itu digunakan lapisan pelat baja pada baling balingnya. Selanjutnya digunakan alat Sincronize yakni alat yang dapat membuat antara putaran baling baling pesawat sinkron dengan penembakan senapan mesin sehingga peluru mencecar melewati celah baling-balingnya.\r\n\r\nKemudian bentuk dan teknis pesawat diperbaiki meskipun pada umumnya pesawat tersebut masih terbuat dari kayu. Umumnya pesawat pesawat tersebut menggunakan mesin radial sehingga tidak dilengkapi dengan antifreeze (anti beku) sehingga mesin pesawat harus dibersihkan dari cairan baik pelumas ataupun bahan bakar. Muncullah rancangan rancangan yang dikenal pada zamannya seperti Triplane (Pesawat dengan sayap bersusun tiga), Biplane (pesawat dengan sayap bersusun dua). Ataupun pesawat berukuran raksasa untuk pembom seperti Ilya Muromet\'s (Rusia).\r\n\r\nPada Generasi ini dikenal pesawat-pesawat Fokker, Sopwith Camel, Gotha (bomber) dan lain lain dengan pernerbang penerbang seperti Baron von Richthofen, Manfred von Richthoven (Jerman) dan lain lain.', 'pesawat tempur, perang dunia I. ', '20171027-triplane.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '36', NULL, 'pesawat-triplane-red-baron', NULL, NULL, NULL),
