at Fokker, Sopwith Camel, Gotha (bomber) dan lain lain dengan pernerbang penerbang seperti Baron von Richthofen, Manfred von Richthoven (Jerman) dan lain lain.', 'Pesawat Tempur, Perang Dunia I, ww1', '20171027-biplane.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '37', NULL, 'pesawat-biplane-sopwith-camel', NULL, NULL, NULL),
(12190, '12', '66', '20171027-66SimplePlanes 2017-10-27 20-35-31-624_x264.mp4', 'jpg', 'Pesawat Low Wings (ME- Bf 109)', 'Pada masa Perang Dunia II, bentuk pesawat mengalami perubahan yang lebih jauh daripada era sebelumnya. Perubahan itu diantaranya meliputi, bahan yang digunakan, desain pesawat, mesin pesawat, cokpit serta dilengkapi dengan sistem radio bahkan ada yang dilengkapi radar. perubahan tersebut seiring dengan perkembangan teknologi pada masa itu misalnya radar pada sistem pertahanan melengkapi lampu sorot (search light) yang dapat mencium jejak pesawat lawan pada jarak yang jauh serta berbagai cuaca dan waktu. Mesin pesawat yang tidak lagi menggunakan bentuk radial serta dilengkapi dengan sistem injeksi bahan bakar seperti Messerschmit yang memungkinkan pesawat dapat bergerak lebih lincah serta dapat distarter langsung dari kokpit tanpa bantuan staf darat. Bahkan menjelang akhir perang mulai diluncurkannya pesawat bermesin jet seperti Gloster Meteor dan Messerschmitt Me-262. Bahan pesawat yang terbuat dari metal sekalipun penemuan radar membuat pesawat tersebut mudah diketahui pihak lawan. Desain pesawat yang lebih ramping streamline terlebih-lebih menjelang akhir perang.\r\n\r\nDari sistem senjata selain dilengkapi senapan mesin baik kaliber 7,7 mm, 12,7 mm, sampai 20 mm bahkan ada yang dilengkapi roket seperti halnya P-51 Mustang dan Me-262.\r\n\r\nPada saat ini juga digunakannya pesawat tempur yang diluncurkan dari Kapal Induk meskipun diperkenalkan oleh Angkatan Laut Inggris pertama kali pada tahun 1912. Terlebih lebih di medan pasifik dimana pertempuran lebih banyak terjadi di lautan antara Jepang dengan Amerika.\r\n\r\nPada masa ini dikenal pesawat seperti Messerschmit Bf 109, Focke Wolf (Jerman) , Spitfire, Hurricane (Inggris), P-51 Mustang, P-38 Lightning (USA), Mitsubishi A6M2 Zero, Hayabusha (Jepang). Lavochkin, Sturmovik (Rusia). Serta mengenal jagoan-jagoan (The Aces) di udara diantaranya Mayor Eritch Hartmann (Jagoan dari segala jagoan, lebih dari 300 pesawat lawan dijatuhkan, dari Jerman), Peltu Hiroshi Nishizawa, Saburo Sakai, Ohta (Jepang).', 'pesawat tempur, perang dunia II, ', '20171027-monoplane.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '36', NULL, 'pesawat-low-wings-me-bf-109', NULL, NULL, NULL),
