 dari 300 pesawat lawan dijatuhkan, dari Jerman), Peltu Hiroshi Nishizawa, Saburo Sakai, Ohta (Jepang).', 'pesawat tempur, jet, perang dunia I, ', '20171027-jet pertama.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '52', NULL, 'pesawat-jet-pertama-me-262', NULL, NULL, NULL),
(12192, '16', '66', '20171028-66SimplePlanes 2017-10-28 10-25-04-977_x264.mp4', 'jpg', 'Pesawat Monoplane (Fokker D.VII)', 'Pada awal 1918, Fokker memproduksi beberapa prototip monoplane bertenaga rotari. Dari jumlah tersebut, Fokker menyerahkan V.26 dan V.28, monoplane bersayap tinggi dengan badan tabung baja biasa, untuk percobaan tempur kedua di Adlershof pada bulan Mei / Juni 1918. V.28 diuji dengan 108 kW (145 hp) Oberursel UR.III dan 119 kW (160 hp) Goebel Goe.III, meski kedua mesin ini belum siap untuk layanan operasional. V.26 menggunakan mesin Oberursel UR.II standar, yang menghasilkan hanya 82 kW (110 hp). Sementara mesin ini sudah usang, daya tarik dan ringan V.26 yang rendah berarti cukup cepat. Desain Fokker baru saja dihantam oleh Siemens-Schuckert D.III dengan mesin bi-rotary Siemens-Halske Sh.III yang kompleks.\r\n\r\nPada akhirnya, V.26 diperintahkan untuk diproduksi sebagai Fokker E.V. Empat ratus orang diperintahkan segera dengan baik UR.III atau Goe.III. Karena mesin tidak tersedia dalam jumlah apapun, semua contoh produksi dipasang di UR.II.', 'pesawat, pesawat tempur, monoplane, high wings', '20171028-monoplane hi.jpg', NULL, NULL, NULL, NULL, '<a href=\"https://en.wikipedia.org/wiki/Fokker_D.VIII\">https://en.wikipedia.org/wiki/Fokker_D.VIII<br /><br /><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/1/16/Fokker_D.VIII_3_vues.jpg/800px-Fokker_D.VIII_3_vues.jpg\" /><br /></a>', NULL, NULL, NULL, NULL, 1, '40', NULL, 'pesawat-monoplane-fokker-dvii', NULL, NULL, NULL),
