(12232, '7', '1030', '20171101-1030Pala Banda 640x480 2017-11-01 07-57-11.mp4', 'mp4', 'SD INPRES 7 BOMBERAY', 'buah Pala atau Myristicafragrans,tumbuhan pohon menjadi komoditi perdagangan yang penting sejak masa Romawi ensiklopedia karya Plinius \"Si Tua\". Semenjak zaman eksplorasi Eropa pala Mauritius dan Karibia (Grenada). berumah dua (dioecious) sehingga dikenal pohon jantan dan pohon betina biji, salut bijinya (arillus), salut biji pala dinamakan fuli, atau dalam bahasa Inggris disebut mace, dalam istilah farmasi disebut myristicae arillus atau macis). Daging buah pala dinamakan myristicae fructus cortex. Panen pertama.', 'BUAH PALA BANDA,SAUNIN GWAS GWAS FAKFAK.PAPUA BARAT.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '71', NULL, 'sd-inpres-7-bomberay', NULL, NULL, NULL),
