(12235, '10', '969', '20171101-969Video pembelajaran TIK (Teknologi Informasi dan Komunikasi) 960x540 2,13Mbps 2017-11-01 10-44-18.mp4', 'mp4', 'Cara menghubungkan Internet ', 'Cara menghubungkan Komputer ke Internet ada yaitu :\r\n1. Melalui jaringan LAN\r\n2. Melalui jaringan WIFI\r\n3. Melalui jaringan Operator Selular\r\n\r\nMelalui Jaringan LAN\r\nBila komputer kamu terkoneksi ke dalam jaringan LAN, Kamu tinggal mengatur Local Area Connection yang berada di Control Panel. Kemudian Setting IP Address sesuai dengan pengalamatan kelas yang ada di jaringan atau dipilih Obtain an IP address automatically.\r\n\r\nMelalui jaringan WIFI\r\nCara lain untuk agar bisa berinternet yaitu mengkoneksikan komputer melalui jaringan WIFI. Kamu bisa memanfaatkan WIFI apa saja, apakah itu WIFI sekolah, WIFI layanan umum dan lain sebagainya. Silahkan Kamu masuk ke Control Panel dan hidupkan WIFI komputer Kamu sehingga antara WIFI komputer Kamu dan WIFI penyedia tersambung.\r\n\r\nMelalui jaringan Operator Selular\r\nPada jaringan ini, biasanya koneksi jaringan melalui kartu selular yang biasa kita pakai untuk berkomunikasi lewat handphone. Tinggal koneksikan internet Kamu melalui aplikasi modem atau jalankan paket data apabila menggunakan hp untuk mengakses GPRS, 3G atau pun 4G. Pada jarignan operator selular ini dipengaruhi oleh paket data yang ada pada provider dan kekuatan sinyal di area kamu.', 'Internet ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '40', NULL, 'cara-menghubungkan-internet', NULL, NULL, NULL),
