(12255, '16', '1043', '20171102-1043Untitled 1 640x480 2017-11-01 10-27-41.mp4', 'mp4', 'PENGUASAAN MEDIA TEKNOLOGI', 'Penguasaan teknologi informatika bagi guru sangatlah penting. Sebab dengan menguasai TIK maka seorang guru dapat mempersiapkan mediA pembelajaran yang bervariasi dan menyenangkan. Misalnya menggunakan media pembelajaran lewat video, dengan demikian secara langsung siswa diajak untuk berperan aktif.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '32', NULL, 'penguasaan-media-teknologi', NULL, NULL, NULL);
