(12256, '15', '1073', '20171102-1073KIT Hand Made Berbahan Limbah_x264.mp4', 'jpg', 'KIT Hand Made Berbahan Limbah', 'Para guru IPA ketika mengajar biasanya  hanya menampilkan media pembelajaran atau KIT IPA yang tersedia di laboratorium. Ditinjau dari kemajuan infrastruktur sekolah, hal ini mengindikasikan bahwa ketersediaan KIT IPA semakin lengkap di setiap sekolah. Lantas, bagaimana apabila KIT IPA tidak tersedia di laboratorium ? Padahal, sebuah konsep yang abstrak tidak cukup dibelajarkan hanya dengan medote ceramah? Alternatif solusinya, adalah KIT Hand Made (KIT buatan tangan/buatan sendiri). Terlepas dari kondisi kelengkapan fasilitas laboratorium IPA, pendidikan hendaknya dapat terus diselenggarakan tanpa harus menunggu lengkapnya fasilitas. “Oleh karena itu untuk menjaga kelangsungan pendidikan IPA melalui praktikum/eksperimen, perlu dikembangkan alternatif alat peraga-praktik IPA yaitu alat peraga-pratik sederhana (buatan sendiri) agar pembelajaran IPA dapat berjalan secara optimal. Hal tersebut penting  bagi guru/sekolah dengan alasan sebagai berikut; Pertama, alat peraga-pratik IPA sederhana sebagai upaya melengkapi peralatan yang dibutuhkan dalam pembelajaran. Para guru dapat memberdayakan berbagai sumber daya yang ada di sekitar sekolah dan tempat tinggal peserta didik untuk pengembangan alat peraga praktik IPA sederhana. Kedua, alat peraga-pratik IPA sederhana ini dapat dijadikan sebagai alternatif peralatan laboratorium; meningkatkan kreativitas guru dan peserta didik; sebagai upaya meragamkan sumber belajar peserta didik; agar peserta didik dapat membangun pengetahuan dan keterampilan serta sikap yang sesuai dengan kompetensi yang disarankan dalam kurikulum.” (Kemdikbud:2011). Permasalahan limbah sudah menjadi masalah global yang pelik, sehingga perlu adanya inisiatif untuk mengatasinya. Salah satunya, memanfaatkan limbah menjadi bahan pembuatan KIT IPA. Limbah adalah buangan atau sisa yang dihasilkan dari suatu proses atau kegiatan dari industri maupun domestik (rumah tangga). Apabila para siswa terbiasa dengan peralatan standar KIT IPA yang tersedia di laboratorium, mental konseptual secara perlahan akan terbentuk dan mematikan cara berpikir kreatif.  Dengan kata lain, akan tertanam dalam alam pikiran siswa, jika tidak tersedia peralatan standar KIT IPA maka eksperimen IPA tidak dapat berlangsung. Idealnya, disamping menggunakan KIT IPA standar laboratorium, guru semestinya juga mengajak para siswa untuk berpikir kreatif, dengan memancing mereka dengan pertanyaan-pertanyaan, antara lain; sambil menunjukkan salah satu  KIT IPA, guru melontarkan pertanyaan, “Mungkinkah alat ini dapat kita buat sendiri dari limbah  yang ada di sekitar kita?” Apakah kalian mempunyai ide agar alat ini menjadi lebih sempurna?” Misalnya, untuk materi cara kerja lensa mata memfokuskan bayangan di retina. Biasanya, guru hanya menampilkan torso dan gambar mata, sedangkan proses menebal dan memipihnya lensa mata hanya disampaikan secara verbal. Hanya sampai disitukah penjelasan guru tentang cara kerja lensa mata? Mengacu pada strategi pembelajaran berbasis CTL (Contextual Teaching and Learning), sebaiknya guru mencoba menggali ide-ide dari para siswa. Diawali diskusi klasikal antara guru dengan siswa, kemudian bersama-sama mencoba merancang alat praktik lensa mata yang dapat dikondisikan menebal dan memipih. Bahan-bahannya diambil dari barang-barang yang sudah tidak terpakai/sisa/sampah, misalnya paralon sisa, balon karet, alat suntik tinta printer, sedotan aqua gelas, kotak kardus, dan lain-lain. Disamping menanamkan kreativitas, akan tumbuh arti penting mengelola limbah berbasis Reuse-Reduce-Recycle (3R). Efek jangka panjang, mental kreatif yang tertanam dalam diri para siswa akan menjadi sense of lifeskill yang akan menjadi fondasi kehidupannya kelak melalui kreativitas vokasional, pembelajaran yang berkualitas, serta merangsang ide dalam pemanfaatan limbah. ', 'KIT Hand Made Eko', '20171102-ft pus.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '52', NULL, 'kit-hand-made-berbahan-limbah', NULL, NULL, NULL),
