(12274, '11', '1031', '20171102-1031VID-20171102-WA0000.mp4', 'jpg', 'The Elephant ', 'An Elephant is the largest and strongest of all animals. It is a strange looking animal which it has thick legs, huge sides and backs, large hanging ears, a small tail, little eyes, long white tusk and above all, elephant has a long nose, the trunk. An Elephant is commonly seen in a zoo,it has hard found in it natural habitat. The Elephant is very intelligent animal. Its intelligence combined with its great strength make an elephant a very useful servant to man. An Elephant is really a smart animal. ', 'Elephant ', '20171113-fauna.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '50', NULL, 'the-elephant', NULL, NULL, NULL),
(12276, '6', '998', '20171102-998Video_20171102221707552_by_vidcompact.mp4', 'png', 'MANFAAT BUAH SEMANGKA', 'Ada beberapa manfaat buah semangka, yaitu:\r\n1. Mengontrol tekanan darah tinggi\r\n2. Mengurangi lemak berlebih\r\n3. Menjaga tubuh tetap terhidrasi\r\n4. Menjaga kesehatan mata\r\n5. Menjaga kesehatan ginjal\r\n6. Menjaga kesehatan jantung\r\n7. Melawan kanker\r\n8. Memberi energi\r\n8. Mencegah dan mengobati diabetes', '', '20171102-Screenshot_2017-11-01-22-38-51-1.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '57', NULL, 'manfaat-buah-semangka', NULL, NULL, NULL),
(12277, '7', '1029', '20171103-1029Untitled 640x360 0.94Mbps 2017-11-01 07-02-36.mp4', 'jpeg', 'Kenampakan Alam di Indonesia', 'Kenampakan alam adalah segala sesuatu yang nampak di permukaan bagian bumi atau alam. Permukaan bumi terdiri dari daratan dan perairan. Misalnya gunung, hutan, sungai, pelabuhan, bandara d.l.l ', 'Kenampakan Alam di Indonesia. By Ahmad Wahyudi. SDN SAHAREY FAKFAK TIMUR', '20171103-images-24.jpeg', 'By : Ahmad Wahyudi<br />SDN Saharey Fakfak Timur', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '58', NULL, 'kenampakan-alam-di-indonesia-3', NULL, NULL, NULL),
(12278, '7', '1043', '20171103-1043Untitled 1 640x480 2017-11-01 10-27-41.mp4', 'jpg', 'PENGUASAAN MEDIA TEKNOLOGI', 'Penguasaan ilmu pengetahuan teknologi sangatlah diharapkan diera modern dewasa ini. Penguasaan IPTEK khususnya TIK yang baik akan mempermudah seseorang dalam melakukan segala keperluan dengan mudah lewat dunia internet. Penguasaan internet sangat diharapkan bagi seorang guru sehingga membantu guru dalam menunjang kelancaran proses belajar mengajar. Dengan menggunakan berbagai media pembelajaran yang bervariasi akan menciptakan suasana belajar mengajar di dalam kelas yang menyenangkan bagi siswa.\r\n', 'Alex Media', '20171113-teknologi.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '39', NULL, 'penguasaan-media-teknologi-2', NULL, NULL, NULL),
(12279, '5', '1007', '20171103-1007Untitled 9 960x540 2017-11-01 12-05-30.mp4', 'jpg', 'Bryophyta(Tumbuhan lumut)', 'Lumut (bryophyta) adalah sebuah divisi tumbuhan yang hidup didarat, yang umumnya berwarna hijau dan berukuran kecil (dapat tidak tampak dengan bantuan lensa), dan ukuran lumut yang terbesar adalah kurang dari 50 cm.', 'PLANTAEA', '20171103-th.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '61', NULL, 'bryophytatumbuhan-lumut-2', NULL, NULL, NULL),
(12280, '12', '66', '20171103-66Ubadari 960x540 2017-11-02 09-12-12.mp4', 'jpg', 'Ubadari', 'Ubadari adalah sebuah obyek wisata alam berupa air  terjun yang terletak di kabupaten Fakfak, Papua Barat. Air terjun Ubadari termasuk air terjun tipe Kaskade.', 'Air terjun, Kaskade,', '20171103-IMG_20171103_083528.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '82', NULL, 'ubadari', NULL, NULL, NULL),
(12281, '6', '1010', '20171103-1010kingdom animalia 1280x720 3,78Mbps 2017-11-01 10-55-08.mp4', 'jpg', 'Kingdom animalia', 'ingdom Animalia atau biasa disebut hewan merupakan organisme eukariotik (organisme dengan sel kompleks)  yang multiseluler. Berbeda dengan tumbuhan, hewan tidak memiliki klorofil sehingga tidak dapat melakukan fotosintesis untuk membuat makanannya sendiri. Oleh karena itu, hewan harus mencari makanannya sendiri untuk mendapatkan energi  kemudian makanan tersebut dicerna di dalam tubuhnya. Proses ini membutuhkan oksigen dan mengeluarkan karbon dioksida sebagai zat sisa.', '', '20171113-animalia.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '28', NULL, 'kingdom-animalia', NULL, NULL, NULL),
(12283, '3', '1099', '20171103-1099uji kandungan glukosa pada urine 640x360 0,94Mbps 2017-11-03 10-19-20(0).mp4', 'jpg', 'Uji Kandungan Glukosa Pada Urine 2', 'Jika urine mengalami perubahan warna merah bata maka urine mengandung glukosa', 'Uji Urine', '20171103-foto bu eni.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '9', NULL, 'uji-kandungan-glukosa-pada-urine-2', NULL, NULL, NULL),
(12284, '12', '1093', '20171103-1093Stop Bullying 3 960x540 2,13Mbps 2017-11-02 17-11-36.mp4', 'jpg', 'Stop Bullying', 'Bullying adalah penggunaan kekerasan, ancaman, atau paksaan untuk menyalahgunakan atau mengintimidasi orang lain. Perilaku ini dapat menjadi suatu kebiasaan dan melibatkan ketidakseimbangan kekuasaan sosial atau fisik. Hal ini dapat mencakup pelecehan secara lisan atau ancaman, kekerasan fisik atau paksaan dan dapat diarahkan berulang kali terhadap korban tertentu, mungkin atas dasar ras, agama, gender, seksualitas, atau kemampuan. Tindakan penindasan terdiri atas empat jenis, yaitu secara emosional, fisik, verbal, dan cyber. Budaya penindasan dapat berkembang di mana saja selagi terjadi interaksi antar manusia, dari mulai di sekolah, tempat kerja, rumah tangga, dan lingkungan', 'bullying, stop bullying', '20171113-bulying.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '42', NULL, 'stop-bullying', NULL, NULL, NULL),
