(12287, '8', '1035', '20171103-1035VID-20171103-WA0004.mp4', 'jpg', 'Cake Brownis', 'Cake Brownis\r\nBrownis diperkirakan berasal dari Amerika Serikat. Brownis di kenal sebagai cake panggang yang kaya akan coklat. Lalu beberapa waktu kemudian resepnya dimodifikasi lagi dengan penambahan telur.\r\nSekarang brownis suda di modifikasi menjadi bermacam - macam rasa dengan penambahan bahan seperti keju,strawberry,bluberry,kacang,kopi danll.\r\nAwalnya ada seorang koki yang lupa untuj memasukan baking powder kedalam adonan. Sehingga brownis tersebut tidak mengembang seperti kue lainnya.\r\nNama Brownis di ambil dari \r\nThe deep brown color of cook', 'Widati ali abas Asal mula Cake Brownis SMP Yapis 1 Fakfak', '20171113-brouwnis.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '32', NULL, 'cake-brownis', NULL, NULL, NULL),
(12288, '3', '1089', '20171104-1089LINGKUNGAN 720x480 2017-11-02 10-28-47.mp4', 'jpg', 'Lingkungan', 'Lingkungan dibedakan menjadi 2 yaitu lingkungan alam dan lingkungan buatan. \r\nLingkungan alam contohnya : sungai, gunung, pantai, danau, laut, hutan dll. \r\nLingkungan buatan contohnya : waduk, sawah, taman, tambak dll. ', 'Lingkungan di sekitar rumah dan sekolah. ', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '11', NULL, 'lingkungan', NULL, NULL, NULL),
(12289, '2', '1085', '20171104-1085CARA_MEMBUAT_HOME_GROUP_SHARE_DATA_DALAM_SATU_JARINGAN[1].mp4', 'jpg', 'CARA MEMBUAT HOMEGROUP / SHARE DATA DALAM SATU JARINGAN', 'HomeGroup adalah fasilitas yang diberikan oleh Microsoft semenjak Windows 7 yang difungsikan untuk berbagi file dan data lainnya yang terhubung dalam 1 jaringan. Berbagi file ini tentu saja tidak memerlukan koneksi internet. Yang penting adalah anda terhubung dengan 1 jaringan dengan komputer lainnya. Y\r\nMenggunakan HomeGroup di Windows 10 sangatlah mudah. Yang perlu anda persiapkan hanyalah sebuah jaringan yang terkoneksi ke semua komputer yang ingin anda bagikan. Pesan yang terakhir, pastikan komputer anda tidak terlalu jauh dengan Wireless Router, jika anda menggunakan perangkat Wireless. Karena akan berdampak pada kecepatan transfer data.', 'Aku adalah seseorang yang menyukai teknologi. Bagiku, teknologi bukan membuat manusia menjadi malas. Namun tentang bagaimana menggunakan teknologi agar kita dapat mengerjakan hal lainnya, seh', '20171104-HAHAHAH.jpg', NULL, NULL, NULL, NULL, 'daftar pustaka&nbsp;<a class=\"Cae ogd pgd\" href=\"https://plus.google.com/+KusnendarWebIdonline?prsrc=5\" target=\"_blank\" rel=\"noopener noreferrer\">kusnendar.web.id</a>', NULL, NULL, NULL, NULL, 1, '50', NULL, 'cara-membuat-homegroup-share-data-dalam-satu-jaringan', NULL, NULL, NULL),
