(12293, '3', '1027', '20171104-1027VID-20171104-WA0005[1].mp4', 'jpg', 'Masjid Al-Yassin Patimburak Kokas Fakfak', 'Kokas adalah salah satu distrik yang ada di Fakfak Papua Barat. Berjarak 50 km dari pusat pemerintahan Kabupaten Fakfak. Di sana terdapat sebuah masjid tertua yang dibangun pada tahun 1870 Masehi yang diberi nama Masjid Al-Yassin Patimburak. yang menjadikan masjid ini unik karena ornamen bangunannya yang merupakan gabungan dari masjid dan gereja. Karena keberadaan masjid tertua yaitu berumur 200 tahun inilah maka Fakfak terkenal dengan serambi mekahnya Papua. masjid yang kurang lebih seluas 100 meter persegi ini telah mengalami beberapa kali renovasi, namun materiil asli yang belum diganti adalah empat pilar penyangga yang terdapat di dalam majid. ', 'masjid al-yassin patimburak', '20171104-masjid.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '53', NULL, 'masjid-al-yassin-patimburak-kokas-fakfak', NULL, NULL, NULL),
