(12298, '13', '1070', '20171104-1070Belajar Pantun dari Lagu Fatin Shidqia Lubis 960x540 2017-11-05 02-08-31.mp4', 'png', 'Belajar Pantun dari Lagu Fatin Shidqia Lubis', 'Pantun merupakan salah satu jenis puisi lama dari Indonesia. Pantun mempunyai syarat-syarat khusus sebagaimana syarat untuk jenis puisi lama yang lain. Berikut ini kita akan belajar tentang syarat-syarat pantun dari lagu Fatin Shidqia Lubis yang berjudul \"Sepohon Kayu\" karya Ust. Jefri Al Buchori. Semoga bermanfaat.', 'Syarat Pantun Lagu Fatin', '20171104-Fatin_Shidqia.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '51', NULL, 'belajar-pantun-dari-lagu-fatin-shidqia-lubis', NULL, NULL, NULL),
(12299, '13', '1069', '20171104-1069Volume Tabung Dengan Pendekatan Volume Balok 960x540 2,13Mbps 2017-11-05 03-33-20.mp4', 'png', 'Volume Tabung Dengan Pendekatan Volume Balok', 'Rumus volume tabung dapat diturunkan dari rumus volume balok. Pada sisi atas tabung dibelah menjadi sebanyak mungkin bagian sehingga diperoleh sejumlah bangun ruang yang masing-masing kongruen. Kemudian semua hasil pembelahan tersebut disusun ulang menjadi bangun ruang balok. Sehingga diperoleh volume tabung = volume balok.', 'SMP, Matematika, Volume Tabung, Volume Balok', '20171105-Screenshot_2017-11-05-08-28-00.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '135', NULL, 'volume-tabung-dengan-pendekatan-volume-balok', NULL, NULL, NULL),
(12300, '4', '1020', '20171105-1020Untitled 1 640x360 2017-11-01 11-23-09.mp4', 'jpg', 'BOLA VOLLY', 'Pada video pembelajaran ini menjalaska 3 teknik dasar permainan bola volly n 1 kombinasi variasi\r\n1.teknik passing bawa \r\nLatihan passing bawah dengan posisi kaki d buka salah satu maju lutut sedikit di tekuk berat badan kedepan dan kedua tangan berpegangan. Ayunkan kedua tangan ketika bola berada pada jarak yang tepat\r\n2. Passing atas\r\nPada saat melakukan passing atas posisi kedua tangan di letakkan di atas muka kedua ibu jari dan telunjuk membentuk segitiga. Siku atas di bengkokkan dan kedua kaki di buka dan ditekuk. Pandangan ke ats ke arah bola, tangan di ayungkan ketika bola berada pada jarak yg tepat\r\n3.smash\r\nPada saat melakukan smash d dinding posisi tangan di angkat ke atas selurus mungkin diatas kepala. Kemudian ayunkan lengan dan memukulkan telapak tangan sekuat mungkin ke arah bola dengan di pantulkan ke tanah sehingga bola dapat terpantul di dinding.\r\nKOMBINASI VARIASI\r\nPada saat melakukan variasi tekni passing bawah, atas, dan smash lekukan secara berpasangan lakukan gerakan ke tiga teknik dasar tersebut secara bergantian', 'Latihan dasar bola volly \"IP\"', '20171105-volley.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '46', NULL, 'bola-volly', NULL, NULL, NULL),
(12303, '17', '1054', '20171105-1054coto makasaar.mp4', 'jpg', 'Coto Makassar', 'Makanan Khas Makassar sulawesi selatan', '', '20171113-cotto.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '46', NULL, 'coto-makassar', NULL, NULL, NULL),
(12304, '5', '1045', '20171105-1045Penanaman Lidah Buaya 640x360 0,94Mbps 2017-11-05 12-45-31.mp4', 'mp4', 'Penanaman Lidah Buaya', 'Lidah buaya adalah salah satu tumbuhan yang sdh dikenal sejak ribuan tahun,  dan merupakan salah satu tumbuhan has yang memiliki banyak manfaatnya terutama untuk kesehatan. \r\nCiri-ciri lidah buaya yaitu daunnya merapat,  wujud daunnya mirip pedang, ujungnya meruncing, batang berbentuk tunas, panjang daun 50-75 CM,  berat 0,5 - 1 Kg.\r\nMenanam lidah buaya dapat menggunakan pot/polybag dengan ukuran sedang dan berukuran berkisar 20 CM. \r\nTempat tumbuhan lidah buaya harus diperhatikan betul-betul dengan menggunakan tanah kering dan dapat pula dicampur pasir serta pupuk kandang kemudian dimasukkan dlm pot/polybag.\r\nCara penanamannya tidak sulit hampir sama dengan tanaman lainnya\' dengan mengambil lidah biaya yang masih kecil kemudian tanam sperti menanam tanaman lainnya, tanaman lidah buaya jangan terlalu dangkal atau terlalu dalam karena dapat mengakibatkan bibit busuk atau roboh. \r\nLidah buaya menggunakan pupukn organik yang diberikan seminggu sekali sebanyak 2 gram. \r\nTanaman lidah buaya mengalami pembusukan apabila dilakukan penyiraman secara terus menerus,  karena lidah buaya banyak menyimpan air. \r\nPenempatan lidah buaya ditempat yang teduh namun terkena sinar matahari secara langsung. \r\nMemanen lidah buaya setelah berumur 6 bulan, lidah buaya dpt dipetik atau menggunakan pisau pada daun paling luar. \r\nPotong ujung berduri kedua sisi daun, lepaskan lendir lidah buaya dengan menggunakan sendok lalu letakkan lendir lidah buaya dimangkok atau gelas. Air lendir lidah buaya dapat dimanfaatka untuk kesehatan, mengobati berbagai penyakit seperti diabetes, bisul, mengontrol tekanan darah, menghilangkan rasa nyeri kepala, strees dan dpt menyuburkan rambut serta sebagai masker pada wajah. \r\n\r\n', 'aloe vera', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '2', NULL, 'penanaman-lidah-buaya', NULL, NULL, NULL),
