(12314, '7', '981', '20171107-981Elemen Siklus Informasi Komputer-1.mp4', 'mp4', 'Elemen Siklus Informasi Komputer', 'Elemen Siklus Informasi Komputer merupakan elemen-elemen yang membentuk data sehingga menjadi informasi sesuai kebutuhan. Elemen-elemen tersebut berupa :\r\n- Data merupakan elemen dasar sebagai bahan yang akan dimasukkan/direkam ke dalam peralatan proses\r\n- Informasi merupakan hasil pengolahan data oleh peralatan proses sehingga menjadi lebih bermakna sesuai kebutuhan\r\n- Input Device adalah peralatan yang digunakan untuk memasukkan/merekam data kedalam peralatan proses\r\n- Proses Device adalah peralatan yang digunakan untuk mengolah, membentuk, dan menduplikasi serta menyimpan dan mengkomunikasi hasil pengelolaan data\r\nOutput Device adalah peralatan yang digunakan untuk menampilkankan dan mengkomunikasikan informasi dari peralatan proses', 'Informasi;Inputdevice;outputdevice;prosesdevice;Data', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '9', NULL, 'elemen-siklus-informasi-komputer', NULL, NULL, NULL),
