(12368, '7', '1075', '20171109-1075Roket01_x264.mp4', 'jpg', 'KERJA ROKET', 'Hukum kekekalan momentum dapat menjelaskan bagaimana sebuah roket dapat terbang ke luar angkasa. \r\nKetika roket diam, jumlah momentumnya nol. Saat roket dinyalakan, gas menyembur ke belakang, maka ada momentum kearah belakang, untuk mengimbangi momentum yang ke belakang supaya jumlah momentum tetap nol, maka roket bergerak ke depan, artinya ada momentum ke depan.', 'ROKET, MOMENTUM, KEKEKALAN MOMENTUM', '20171109-Roket 2.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '49', NULL, 'kerja-roket', NULL, NULL, NULL),
