(12393, '18', '1007', '20171113-1007Untitled 800x480 2017-11-12 03-41-08.mp4', 'jpg', 'Chordata', 'Chordata adalah kelompok hewan, termasuk vertebrata dan beberapa binatang yang mirip invertebrata yang memiliki ciri-ciri yang serupa. Semua anggota kelompok ini, pada suatu saat dalam kehidupan mereka, memiliki notokorda, tali saraf dorsal berongga, celah faring (pharyngeal slits), endostyle, dan ekor berotot yang melewati anus. ', '', '20171113-images.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '42', NULL, 'chordata', NULL, NULL, NULL),
(12394, '3', '1140', '20171113-1140VID-20171109-WA0011.mp4', 'jpg', 'Peralatan Teknologi Informasi dan Komunikasi (TIK)', 'Peralatan TIK dari tradisional hingga moderen', '', '20171113-TIK.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '52', NULL, 'peralatan-teknologi-informasi-dan-komunikasi-tik', NULL, NULL, NULL),
(12396, '11', '1007', '20171113-1007VID-20171113-WA0022[1].mp4', 'jpg', 'FUNGI(TUMBUHAN JAMUR)', 'Fungi adalah nama regnum dari sekelompok besar makhluk hidup eukariotik heterotrof yang mencerna makanannya di luar tubuh lalu menyerap molekul nutrisi ke dalam sel-selnya. Kalangan ilmuwan kerap menggunakan istilah cendawan sebagai sinonim bagi Fungi.', '', '20171113-jamur.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '44', NULL, 'fungitumbuhan-jamur', NULL, NULL, NULL),
(12397, '14', '1010', '20171113-1010VID-20171113-WA0014[1].mp4', 'jpg', 'cnidaria', 'Kingdom Animalia atau biasa disebut hewan merupakan organisme eukariotik (organisme dengan sel kompleks)  yang multiseluler. Berbeda dengan tumbuhan, hewan tidak memiliki klorofil sehingga tidak dapat melakukan fotosintesis untuk membuat makanannya sendiri. Oleh karena itu, hewan harus mencari makanannya sendiri untuk mendapatkan energi  kemudian makanan tersebut dicerna di dalam tubuhnya. Proses ini membutuhkan oksigen dan mengeluarkan karbon dioksida sebagai zat sisa.\r\n\r\nCiri khas pada hewan yaitu sel hewan tidak memiliki dinding sel. Hewan banyak mengandung sel otot untuk pergerakannya dan sel saraf yang berfungsi untuk merespon setiap rangsang.\r\n', '', '20171113-is (1).jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '33', NULL, 'cnidaria-2', NULL, NULL, NULL),
(12398, '6', '1010', '20171113-1010animals_1280x720_3,78Mbps_2017-11-13_09-57-43[1].mp4', 'jpg', 'animalia', 'Kingdom Animalia atau biasa disebut hewan merupakan organisme eukariotik (organisme dengan sel kompleks)  yang multiseluler. Berbeda dengan tumbuhan, hewan tidak memiliki klorofil sehingga tidak dapat melakukan fotosintesis untuk membuat makanannya sendiri. Oleh karena itu, hewan harus mencari makanannya sendiri untuk mendapatkan energi  kemudian makanan tersebut dicerna di dalam tubuhnya. Proses ini membutuhkan oksigen dan mengeluarkan karbon dioksida sebagai zat sisa.\r\n\r\nCiri khas pada hewan yaitu sel hewan tidak memiliki dinding sel. Hewan banyak mengandung sel otot untuk pergerakannya dan sel saraf yang berfungsi untuk merespon setiap rangsang.\r\n', '', '20171113-animalia.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '36', NULL, 'animalia', NULL, NULL, NULL),
