(12401, '8', '1007', '20171113-1007Untitled_2_640x360_2017-11-13_15-40-08[1].mp4', 'jpg', 'pteridophyta(Tumbuhan paku)', 'Tumbuhan paku, paku-pakuan, atau pakis-pakisan adalah sekelompok tumbuhan dengan sistem pembuluh sejati (Tracheophyta) tetapi tidak pernah menghasilkan biji untuk reproduksi seksualnya. Alih-alih biji, kelompok tumbuhan ini melepaskan spora sebagai alat penyebarluasan dan perbanyakannya, menyerupai kelompok organisme seperti lumut dan fungi.', '', '20171113-pakis.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '40', NULL, 'pteridophytatumbuhan-paku', NULL, NULL, NULL),
(12402, '7', '1096', '20171114-1096Pembelajaran_IPA_tumbuhan_Kelas_IV.mp4', 'mp4', 'Bagian-Bagian Tumbuhan dan Fungsinya', 'Bagian-bagian tumbuhan adalah akar, batang, daun dan bunga. \r\na. Fungsi Akar: Menyerap air dan zat hara dari dalam tanah ke tumbuhan, memperkokoh tegaknya tumbuhan, sebagai alat pernafasan pada \r\n                         lentisel, menyimpan cadangan makanan pada makanan tertentu\r\nb. Fungsi batang: sebgai penopang tegaknya tumbuhan, menyalurkan zat hara dar akar ke bagian tumbuhan, menyimpan cadangan makanan \r\n                             (tanaman tertentu)\r\nc. Fungsi Daun: sebagai tempat fotosintesis atau memasak makanan pada tumbuhan, sebagai alat pernafasan pada stomata/ mulut daun\r\nd. Fungsi Bunga: sebagai alat perkembangbiakan\r\n', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '24', NULL, 'bagian-bagian-tumbuhan-dan-fungsinya', NULL, NULL, NULL),
(12403, '16', '1096', '20171114-1096Pembelajaran_IPA_tumbuhan_Kelas_IV.mp4', 'mp4', 'Bagian-Bagian Tumbuhan dan Fungsinya', 'Bagian-bagian tumbuhan adalah akar, batang, daun dan bunga. \r\na. Fungsi Akar: Menyerap air dan zat hara dari dalam tanah ke tumbuhan, memperkokoh tegaknya tumbuhan, sebagai alat pernafasan pada \r\n                         lentisel, menyimpan cadangan makanan pada makanan tertentu\r\nb. Fungsi batang: sebgai penopang tegaknya tumbuhan, menyalurkan zat hara dar akar ke bagian tumbuhan, menyimpan cadangan makanan \r\n                             (tanaman tertentu)\r\nc. Fungsi Daun: sebagai tempat fotosintesis atau memasak makanan pada tumbuhan, sebagai alat pernafasan pada stomata/ mulut daun\r\nd. Fungsi Bunga: sebagai alat perkembangbiakan\r\n', 'Pembelajaran IPA', '20171114-tumbuhan.jpg', 'Video Pembelajaran IPA Kelas IV', NULL, '', '', 'Bagian-bagian tumbuhan adalah akar, batang, daun dan bunga.&nbsp;', NULL, NULL, NULL, NULL, 1, '63', NULL, 'bagian-bagian-tumbuhan-dan-fungsinya-2', NULL, NULL, NULL),
