(12420, '9', '1010', '20171115-1010mollusca_1280x720_3,78Mbps_2017-11-15_09-57-28[1].mp4', 'jpg', 'arthopoda', 'Arthropoda adalah hewan dengan kaki beruas-ruas, berukuku dan bersegmen. Istilah Arthropoda berasal dari bahasa Yunani yang terdiri dari dua kata yaitu arthro yang berarti ruas dan podos yang berarti kaki. Arthropoda merupakan hewan tripoblastik selomata dan bilateral simetris. Tubuh Arthropoda terdiri dari kepala, dada, dan abdomen yang keseluruhan dibungkus oleh zat kitin dan kerangka luar (eksoskeleton).  Umumnya diantara ruas-ruas terdapat bagian yang tidak memiliki zat kitin sehingga ruas-ruas tersebut mudah untuk digerakkan. Di waktu tertentu kulit dan tubuh Arthropoda mengalami pergantian kulit (eksdisis)', '', '20171115-arthopoda.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '58', NULL, 'arthopoda', NULL, NULL, NULL),
(12421, '6', '1010', '20171115-1010mollusca_1280x720_3,78Mbps_2017-11-15_10-28-06[1].mp4', 'jpg', 'echinodermata', 'Echidodermata adalah kelompok hewan berduri yang bergerak lamban dengan bantuan kaki tabung dan berada di kelaman laut. Istilah echinodermata berasal dari bahasa Yunani dari kata echi yang berarti berduri, dan derma yang berarti kulit. Echinodermata hidup di laut atau air payau. Echinodermata tidak hidup parasit, dengan beberapa spesies hidup menempel (sesil). Pada Echinodermata dewasa mempunyai bagian tubuh berbentuk simetri radial yaitu bagian tubuh yang mendistribusikan dalam susunan melingkar disekitar poros tengah. Sedangkan pada bagian larvanya mempunyai tubuh yang simeteri bilateral, yaitu bagian tubuh yang satu berdampingan dengan bagian tubuh yang lain, dan jika ditarik garis dari depan ke belakang terlihat bagian tubuh sama antara kiri dan kanan. Larva echinodermata merupakan hewan mikroskopis, transparan, bersilia, dan umumnya berenang bebas di laut. ', '', '20171115-echi.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '171', NULL, 'echinodermata', NULL, NULL, NULL),
