(12433, '16', '1192', '20171119-1192Sejarah indonesia.mp4', 'jpg', 'Sejarah singkat berdirinya candi borobudur', 'Candi borobudur adalah sebuah candi buddha yang terletak di borobudur, magelang, jawa tengah. Candi borobudur didirikan oleh para penganut agama buddha mahayana sekitar abad ke-8 M, pada pemerintahan wangsa syailendra, yang di arsiteki oleh gunadharma. Penamaan candi borobudur pertama kali ditulis dalam buku \"SEJARAH PULAU JAWA\" karya sir thomas raffles. Kata borobudur di ambil dari kata BARA dan BUDUR, BARA yang artinya kompleks candi atau BIARA, sedangkan BUDUR berasal dari kaya BEDUHUR yang artinya atas, dengan demikian borobudur berarti \"BIARA DI ATAS BUKIT\".\r\nCandi borobudur memiliki ukiran yaitu:\r\n-luas dasar 123×123 meter\r\n-tinggi asli 42 meter\r\n-tinggi setelah direnovasi 35 meter.', 'XI TSM 2, SMK NEGERI 2 PURWODADI', '20171124-borobudur.jpg', '18 november 2017', 'Musik dan suara', 'Edit', '<div style=\"text-align: left;\">Candi borobudur adalah sebuah candi buddha yg terletak di borobudur, magelang, jawa tengah.</div>', '<a title=\"sejarah singkat candi borobudur\" href=\"Sejarah indonesia\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Sejarah indonesia</span></span></a>', NULL, NULL, NULL, NULL, 1, '105', NULL, 'sejarah-singkat-berdirinya-candi-borobudur-4', NULL, NULL, NULL),
