(12435, '1', '1308', '20171121-1308Sejarah sumpah pemuda 640x360 0,94Mbps 2017-11-21 05-50-33.mp4', 'mp4', 'SEJARAH SUMPAH PEMUDA DI INDONESIA', 'Sumpah pemuda dilaksanakan pada tanggal 28 oktober 1928 \r\nIsi sumpah pemuda:\r\n1. Kami putra putri indonesia bertanah air satu,tanah indonesia\r\n2.kami putra putri indonesia berbangsa satu,bangsa indonesia\r\n3.kami putra putri indonesia berbahasa satu,bahasa indonesia.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '4', NULL, 'sejarah-sumpah-pemuda-di-indonesia-2', NULL, NULL, NULL),
