(12437, '3', '1010', '20171121-1010annelida_1280x720_3,78Mbps_2017-11-21_16-13-15[1].mp4', 'jpg', 'annelida', ' Annelida adalah kelompok hewan dengan bentuk tubuh seperti susunan cincin, gelang-gelang atau ruas-ruas. Istilah kata Annelida berasal dari bahasa Yunani dari kata annulus yang berarti cincin, dan oidos yang berarti bentuk. Annelida merupakan cacing dengan tubuh bersegmen, tripoblastik dengan rongga tubuh sejati (hewan selomata) dan bernapas melalui kulitnya. Terdapat sekitar 15.000 spesies annelida dengan panjang tubuh mulai dari 1 mm-3 m. Filum Annelida hidup di air tawar, air laut, dan di tanah. Umumnya annelida hidup secara bebas, meskipun ada yang bersifat parasit.  \r\n', '', '20171121-annelida.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '37', NULL, 'annelida', NULL, NULL, NULL),
(12438, '7', '1010', '20171121-1010mollusca1_1280x720_3,78Mbps_2017-11-21_15-57-20[1].mp4', 'jpg', 'mollusca', 'Mollusca adalah kelompok hewan yang bersifat tripoblastik slomata dan invertebrata yang bertubuh lunak dan multiseluler. Istilah Mollusca berasal dari bahasa Yunani dari kata molluscus yang berarti lunak. Mollusca termasuk dalam hewan yang lunak baik yang dengan cangkang ataupun tanpa cangkang. Seperti dari berbagai jenis kerang-kerangan, siput, kiton, dan cumi-cumi serta kerabatanya. Mollusca merupakan filum yang terbesar kedua dari kerajaan binatang (Animalia) setelah filum Arthropoda. Pada saat ini, diperkirakan terdapat 75 ribu jenis, dengan ditambah 35 ribu jenis yang dalam bentuk posil. Molluska hidup di air laut, air tawar, payau, dan darat. Habitat Mollusca dapat berada di palung benua laut sampai pegunungan yang tinggi, dan bahkan dapat ditemukan dengan mudah di sekitar rumah kita. Molluska dipelajari pada cabang zoologi yang disebut dengan malakologi (malacology)', '', '20171121-moluska.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '55', NULL, 'mollusca', NULL, NULL, NULL),
