(12453, '8', '1010', '20171123-1010porifera 1280x720 3,78Mbps 2017-11-23 09-45-55.mp4', 'jpg', 'Porifera', 'porifera adalah hewan invertebrata yang tidak memiliki jaringan sejati (parazoa), tanpa organ dan jaringan yang tidak terspesialisasi dan tubuhya memiliki terdapat banyak pori. Porifera merupakan anggota dari Animalia yang merupakan paling sederhana atau primitif. Habitat dan Cara hidup porifera adalah sebagian besar hidupnya di laut dan sebagin kecil lagi hidup di air tawar. Pada umumnya porifera hidupnya ada didaerah pada perairan yang dangkal dan juga jernih, namun juga diperairan berpasir atau berlumpur. Porifera dewasa hidupnya sesil atau melekat di suatu substrak. Profera hidup secara heterotrof dengan jenis makanan bakteri dan plankton', '', '20171123-porivera.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '21', NULL, 'porifera', NULL, NULL, NULL),
