(12512, '6', '1773', '20171125-1773seni budaya Batik 640x360 0,97Mbps 2017-11-26 20-20-31.mp4', 'mp4', 'Seni batik celup', 'Batik celup adalah cara membuat batik dengan cara sederhana. Adapun alat yang di gunakan :kain katun putih,wantek karet, embet, air, plasti, dan wajan. Caranya.:1.kain kita beri pola,2.kain di pola tadi di bungkus dan di ikat dgn kuat. 3.setelah diikat semua pola tadi lalu pewarnaan. 4.masukkan kain ke dalam wajan yg sdh di isi air. 5.aduk sampai rata6.angkat,buka ikatan tadi lalu jemur\r\n', 'Seni budaya batik perlu di kenalkan pada siswa.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '6', NULL, 'seni-batik-celup', NULL, NULL, NULL),
(12513, '12', '1773', '20171125-1773seni budaya Batik 640x360 0,97Mbps 2017-11-27 04-13-16.mp4', 'jpg', 'Seni batik celup', 'Batik celup adalah cara membuat batik sederhana. Adapun bahan : kain katun putih,wantek,ember,karet,wajan dan plastik. Caranya:1.kain di beri motif 2.bungkus motif tadi semuanya  pakai plastik dan diikat dengan kuat.3.kain di madukkan ke dalam wajan yg sudah diisi air 4.aduk sampai rata 5.angkat dan biarkan agak dingin lalu buka ikatan tadi jemur. ', 'Pelajaran seni budaya \"batik celup\".', '20171126-celup.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '35', NULL, 'seni-batik-celup-2', NULL, NULL, NULL),
