(12550, '11', '1740', '20171128-1740Zat Aditif 640x480 1,26Mbps 2017-11-25 12-07-34.mp4', 'jpg', 'ZAT ADITIF (SMP N 13 TEBO )', 'Zat aditif merupakan bahan yang ditambahkan kedalam makanan baik pada saat memproses ,mengolah, mengemas,menyimpan makanan dan sering juga pada minuman.tujuannya adalah untuk memberi aroma,warna,mengawetkan serta ketertarikan terhadap makanan.\r\n      Zat aditif dibagi menjadi dua:\r\n1.Zat aditif alami contoh daun pandan,wortel,cabai,gula tebu,kunyit buah murbei dan lainnya.\r\n2.Zat aditf buatan contohnya garam,MSG,dinatrium,tartrazine,natrium nitrit,sakarin dan lainnya.', '', '20171128-aditif.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '69', NULL, 'zat-aditif-smp-n-13-tebo', NULL, NULL, NULL),
(12551, '18', '1376', '20171128-1376KERAJAAN DEMAK 640x360 0,94Mbps 2017-11-22 12-31-44.mp4', 'jpg', 'SEJARAH KERAJAAN DEMAK', 'Kerajaan Demak\r\n     Kerajaan Demak merupakan kerajaan Islam pertama di Pulau Jawa. Kerajaan ini didirikan oleh Raden Patah pada tahun 1500 hingga tahun 1550. Raden Patah adalah putra dari Prabu Brawijaya Sebagai kerajaan Islam pertama di pulau Jawa, Kerajaan Demak sangat berperan besar dalam proses Islamisasi pada masa itu. Kerajaan Demak berkembang sebagai  pusat perdagangan dan sebagai pusat penyebaran agama Islam. Wilayah kekuasaan Demak meliputi Jepara, Tuban, Sedayu Palembang, Jambi dan beberapa daerah di Kalimantan. Di samping itu, Kerajaan Demak  juga memiliki pelabuhan-pelabuhan penting seperti Jepara, Tuban, Sedayu, Jaratan dan Gresik yang berkembang menjadi pelabuhan transito (penghubung).           \r\n\r\n    Dalam masa pemerintahan Raden Patah, Demak berhasil dalam berbagai bidang, diantaranya adalah perluasan dan pertahanan kerajaan, pengembangan Islam dan pengamalannya, serta penerapan musyawarah dan kerja sama antara ulama dan umara (penguasa). Keberhasilan Raden Patah dalam perluasan dan pertahanan kerajaan dapat dilihat ketika ia menaklukkan Girindra Wardhana yang merebut tahkta Majapahit (1478), hingga dapat menggambil alih kekuasaan majapahit. Selain itu, Raden Patah juga mengadakan perlawan terhadap Portugis, yang telah menduduki Malaka dan ingin mengganggu Demak. Ia mengutus pasukan di bawah pimpinan putranya, Pati Unus atau Adipati Yunus atau Pangeran Sabrang Lor (1511), meski akhirnya gagal. Perjuangan Raden Patah kemudian dilanjutkan oleh Pati Unus yang menggantikan ayahnya pada tahun 1518. Dalam bidang dakwah Islam dan pengembangannya, Raden Patah mencoba menerapkan hukum Islam dalam berbagai aspek kehidupan. Selain itu, ia juga membangun istana dan mendirikan masjid (1479) yang sampai sekarang terkenal dengan masjid Agung Demak. Pendirian masjid itu dibantu sepenuhnya oleh walisanga. \r\n \r\nLukisan Masjid Agung Demak th 1801\r\n    Pada tahun 1518 Raden Patah wafat kemudian digantikan putranya yaitu Pati Unus. Pati Unus terkenal sebagai panglima perang yang gagah berani dan pernah memimpin perlawanan terhadap Portugis di Malaka. Karena keberaniannya itulah ia mendapatkan julukan Pangeran Sabrang Lor. Armada perang Islam siap berangkat dari pelabuhan Demak dengan mendapat pemberkatan dari Para Wali yang dipimpin oleh Sunan Gunung Jati. Dipimpin langsung oleh Pati Unus bergelar Senapati Sarjawala yang telah menjadi Sultan Demak II. Dari sini sejarah keluarga beliau akan berubah, sejarah kesultanan Demak akan berubah dan sejarah tanah Jawa akan berubah. Kapal yang ditumpangi Pati Unus terkena peluru meriam ketika akan menurunkan perahu untuk merapat ke pantai. Ia gugur sebagai Syahid karena kewajiban membela sesama Muslim yang tertindas penjajah (Portugis) yang bernafsu memonopoli perdagangan rempah-rempah. Pimpinan Armada Gabungan Kesultanan Banten, Demak dan Cirebon segera diambil alih oleh Fadhlullah Khan yang oleh Portugis disebut Faletehan, dan belakangan disebut Fatahillah setelah mengusir Portugis dari Sunda Kelapa 1527. Pengambil alihan ini adalah atas inisiatif Sunan Gunung Jati yang sekaligus menjadi mertua karena putri beliau yang menjadi janda Sabrang Lor dinikahkan dengan Fadhlullah Khan. \r\n\r\n    Sepeninggal Pati Unus, kerajaan Demak kemudian diperintah oleh Sultan Trenggono. Beliau memerintah Demak dari tahun 1521-1546 M. Sultan Trenggono adalah putra Raden Patah, adik dari Pati Unus. Pada tahun 1546 Sultan Trenggono menyerang Panarukan, Situbondo yang saat itu dikuasai Blambangan. Sunan Gunung Jati membantu dengan mengirimkan gabungan prajurit Cirebon, Banten, dan Jayakarta sebanyak 7.000 orang yang dipimpin Fatahillah. Pasukan Demak sudah mengepung Panarukan selama tiga bulan, tapi belum juga dapat merebut kota itu. Suatu ketika Sultan Trenggono bermusyawarah bersama para adipati untuk melancarkan serangan selanjutnya. Putra bupati Surabaya yang berusia 10 tahun menjadi pelayannya. Anak kecil itu tertarik pada jalannya rapat sehingga tidak mendengar perintah Trenggono. Trenggono marah dan memukulnya. ', '', '20171128-demak.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '35', NULL, 'sejarah-kerajaan-demak', NULL, NULL, NULL),
(12552, '5', '1771', '20171128-1771metamorfosis pada hewan ibu gus.mp4', 'jpg', 'Metamorfosis Pada Hewan ', 'Metamorfosis adalah perubahan bentuk tubuh hewan menurut tahap tertentu. metamorfosis terbagi dua yaitu: 1.metamorfosis sempurna adalah hewan yang baru menetas berbeda bentuk dengan induknya, contoh kupu-kupu dan katak\r\n2. metamorfosis tidak sempurna adalah hewan yang baru menetas mempunyai bentuk yang mirip dengan induknya, hanya bagianj tubuh belum lengkap, contoh kecoa. ', '', '20171128-metamorf.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '38', NULL, 'metamorfosis-pada-hewan', NULL, NULL, NULL),
(12553, '18', '1299', '20171128-1299Tugas sejarah indonesia 640x480 1,26Mbps 2017-11-28 19-21-44.mp4', 'jpg', 'Sejarah Candi Prambanan', 'Candi Prambanan atau Candi Roro Jonggrang adalah kompleks candi Hindu terbesar di Indonesia yang dibangun pada abad ke-9 masehi. Candi ini dipersembahkan untuk Trimurti, tiga dewa utama Hindu yaitu Brahma sebagai dewa pencipta, Wishnu sebagai dewa pemelih', '', '20171128-prambanan.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '50', NULL, 'sejarah-candi-prambanan-3', NULL, NULL, NULL),
(12554, '15', '1299', '20171128-1299Tugas sejarah indonesia 640x480 1,26Mbps 2017-11-28 19-21-44.mp4', 'mp4', 'Sejarah Candi Prambanan', 'Candi Prambanan atau Candi Roro Jonggrang adalah kompleks candi Hindu terbesar di Indonesia yang dibangun pada abad ke-9 masehi. Candi ini dipersembahkan untuk Trimurti, tiga dewa utama Hindu yaitu Brahma sebagai dewa pencipta, Wishnu sebagai dewa pemelihara, dan Siwa sebagai dewa pemusnah. Berdasarkan prasasti Siwagrha nama asli kompleks candi ini adalah Siwagrha (bahasa Sanskerta yang bermakna \'Rumah Siwa\'), dan memang di garbagriha (ruang utama) candi ini bersemayam arca Siwa Mahadewa setinggi tiga meter yang menujukkan bahwa di candi ini dewa Siwa lebih diutamakan.', 'Dimasadi_11TITL3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '7', NULL, 'sejarah-candi-prambanan-4', NULL, NULL, NULL),
(12555, '12', '1780', '20171128-1780INDAHNYA KEBERSAMAAN. 1280x720 3,78Mbps 2017-11-27 22-12-07.mp4', 'png', 'INDAHNYA KEBERSAMAAN, TEMATIK KELAS IV', 'Keberagaman Indonesia tercermin pada rumah adat. Kita harus mensyukuri keberagaman dan keindahan rumah adat.', 'Dengan adanya keberagaman membuat kita kaya dengan pengetahuan.', '20171128-Screenshot_2017-11-28-23-26-59-917_com.android.chrome.png', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '29', NULL, 'indahnya-kebersamaan-tematik-kelas-iv', NULL, NULL, NULL);
