(12556, '18', '1710', '20171128-1710Tak berjudul 1 640x360 0,97Mbps 2017-11-28 19-44-26.mp4', 'jpg', 'Sejarah Keraton Surakarta', 'Sejarah Singkat Karaton Surakarta Hadiningrat. Keraton Surakarta atau lengkapnya dalam bahasa Jawa disebut Karaton Surakarta Hadiningrat adalah istana Kasunanan Surakarta. ... Istana ini pula menjadi saksi bisu penyerahan kedaulatan Kerajaan Mataram oleh Sunan PB II kepada VOC pada tahun 1749.', 'SMK NEGERI 2 PURWODADI', '20171128-surakarta.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '19', NULL, 'sejarah-keraton-surakarta', NULL, NULL, NULL),
(12557, '6', '1887', '20171128-1887Tugas_sejarah_Indonesia_salin_640x360_0,94Mbps_2017-11-28_10-31-39[1].mp4', 'png', 'Masjid Menara Kudus', 'Mesjid Menara Kudus (disebut juga dengan Masjid Al Manar (\"Mesjid Menara\", nama resmi: Masjid Al Aqsa Manarat Qudus; ID masjid: 01.5.14.19.02.000001[1]) adalah masjid kuno yang dibangun oleh Sunan Kudus sejak tahun 1549 Masehi (956 Hijriah). Lokasi saat ini berada di Desa Kauman, Kecamatan Kota, Kabupaten Kudus, Jawa Tengah. Ada keunikan dari masjid ini karena memiliki menara yang serupa bangunan candi serta pola arsitektur yang memadukan konsep budaya Islam dengan budaya Hindu-Buddhis sehingga menunjukkan terjadinya proses akulturasi dalam pengislaman Jawa.', 'SMK NEGERI 2 PURWODADI', '20171128-Screenshot_2017-11-28-23-10-49-819_com.android.chrome.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '43', NULL, 'masjid-menara-kudus', NULL, NULL, NULL),
(12558, '8', '1889', '20171128-1889Sejarah_Kerajaan_Kutai_640x360_0,94Mbps_2017-11-28_23-29-16[1].mp4', 'png', 'Sejarah Kerajaan Kutai', 'Kutai Martadipura adalah kerajaan bercorak Hindu di Nusantara yang memiliki bukti sejarah tertua. Berdiri sekitar abad ke-4. Kerajaan ini terletak di Muara Kaman, Kalimantan Timur, tepatnya di hulu sungai Mahakam. Nama Kutai diberikan oleh para ahli mengambil dari nama tempat ditemukannya prasasti yang menunjukkan eksistensi kerajaan tersebut. Tidak ada prasasti yang secara jelas menyebutkan nama kerajaan ini dan memang sangat sedikit informasi yang dapat diperoleh.', 'SMK NEGERI 2 PURWODADI', '20171128-Screenshot_2017-11-29-04-11-01-916_com.android.chrome.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '40', NULL, 'sejarah-kerajaan-kutai-4', NULL, NULL, NULL),
