(12573, '5', '1915', '20171129-1915TUGAS SEJARAH PERISTIWA RENGAS DENGKLOK 640x360 0,94Mbps 2017-11-27 19-28-53.mp4', 'jpg', 'SEJARAH SINGKAT PERISTIWA RENGASDENGKLOK. ', 'Peristiwa Rengasdengklok dilatar belakangi karena adanya perbedaan pendapat antara golongan tua dengan golongan muda. Golongan tua seperti Ir. Soekarno dan Moh. Hatta menginginkan bahwa proklamasi didiskusikan terlebih dahulu dengan PPKI sedangkan golongan muda memaksa agar cepat-cepat diumumkan kemerdekaan, selain itu golongan muda tidak suka dengan PPKI yang tak ingin negara Jepang ikut campur dan tidak terpengaruh oleh Jepang.\r\nSebelum itu golongan pemuda telah mengadakan perundingan di salah satu lembaga bakteriologi di Pegangsaan Timur Jakarta, pada tanggal 15 Agustus. Dalam pertemuan ini diputuskan agar pelaksanaan kemerdekaan dilepaskan segala ikatan dan hubungan dengan janji kemerdekaan dari Jepang. Hasil keputusan disampaikan kepada Ir. Soekarno pada malam harinya tetapi ditolak oleh Soekarno karena merasa bertanggung jawab sebagai ketua PPKI.\r\n ', 'SMK NEGERI 2 PURWODADI', '20171129-rengasdengklok.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '47', NULL, 'sejarah-singkat-peristiwa-rengasdengklok', NULL, NULL, NULL),
