(12579, '13', '1787', '20171129-1787kerajaan tarumanegara 640x360 0,94Mbps 2017-11-29 10-54-27.mp4', 'png', 'Sejarah kerajaan tarumanegara', 'Kerajaan Tarumanegara adalah salah satu kerajaan tertua di Indonesia (kedua setelah Kerajaan Kutai) dan kerajaan tertua di Jawa Barat (sunda) yang meninggalkan catatan sejarah. Tarumanegara berkuasa dari abad ke 4 sampai abad ke 7 Masehi. Dari catatan sejarah dan artefak yang ditinggalkan. Kerajaan Tarumanegara merupakan kerajaan yang beralirkan Hindu.\r\nTarumanegara didirikan oleh Rajadirajaguru Jayasingawarman pada tahun 358 M (naskah wangsakerta). Kerajaan Tarumanegara merupakan kelanjutan dari kerajaan Salakanegara (130-362 M). Pada saat berdirinya kerajaan Tarumanegara,ibukota kerajaan berpindah dari Rajatapura (ibukota Salakanegara) ke Tarumanegara. Salakanegara menjadi kerajaan daerah.\r\n', '', '20171129-Screenshot_2017-11-29-14-05-02.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '31', NULL, 'sejarah-kerajaan-tarumanegara-2', NULL, NULL, NULL),
