(12602, '4', '1329', '20171129-1329sejarah indonesia 640x360 0,86Mbps 2017-11-29 14-01-58.mp4', 'jpeg', 'Asal-usul dan Sejarah Candi Borobudur', 'Borobudur dibangun sekitar tahun 800 Masehi atau abad ke-9 oleh Raja Samaratungga pada dinasty syailendra', '@smkn2purwodadi', '20171129-images-21.jpeg', 'Candi Borobudur adalah candi Budha terbesar di dunia dan merupakan salah satu 7 keajaiban di dunia<br />&nbsp;Sejarah candi Borobudur', NULL, NULL, 'Candi Borobudur adalah salah satu Candi terbesar di dunia, juga termasuk salah satu dalam 7 keajaiban dunia<br />&nbsp;Sejarah singkat mengenai Candi Borobudur, silahkan lihat videonya', '<div>Candi Borobudur adalah Candi Budha terbesar didunia juga termasuk salah satu 7 keajaiban dunia</div>\r\n<div>&nbsp;Sejarah singkat mengenai Candi Borobudur</div>', NULL, NULL, NULL, NULL, 0, '16', NULL, 'asal-usul-dan-sejarah-candi-borobudur', NULL, NULL, NULL),
(12603, '11', '1296', '20171129-1296PERISTIWA 10 NOVEMBER DI SURABAYA 640x360 0,94Mbps 2017-11-29 15-45-28.mp4', 'mp4', 'Peristiwa 10 november 1945, di kota surabaya', 'Peristiwa 10 November ditandai dengan adanya balas dendam sekutu ( inggris ) karena terbunuhnya Brigadir Jenderal Mallaby, pemimpin Negara sekutu ( inggris ) tepatnya di  jembatan merah, Surabaya.\r\nPeristiwa 10 November ini menewaskan 6.000 pejuang Indonesia dan 200.000 rakyat sipil mengungsi dari  kota Surabaya. Karena banyaknya korban tersebut, akhirnya kota Surabaya dikenang sebagai Kota Pahlawan pada tanggal 10 November .\r\n', '', '20171129-Screenshot_2017-11-21-10-45-44-49.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '3', NULL, 'peristiwa-10-november-1945-di-kota-surabaya-2', NULL, NULL, NULL),
