(12605, '9', '1293', '20171129-1293Tak berjudul 640x360 0,94Mbps 2017-11-29 13-39-40.mp4', 'png', 'Candi budha di pulau jawa ', 'Candi Borobudur, tingginya mencapai 42 meter, juga merupakan candi Mahayana, terletak di Magelang, utara Yogyakarta. “Borobudur” berasal dari kata“bara” dan “budur”. Bara berasal dari kata wihara atau biara dari Sansekerta yang berarti kuil atau asrama. Sedangkan budur diperkirakan berasal dari kata beduhur yang artinya “di atas”. Jadi, Borobudur dapat diartikan sebagai biara yang ada di atas bukit. Candi ini didirikan sekitar tahun 800-an M atas perintah raja-raja Mataram dari Dinasti Syailendra.\r\n\r\nBentuk dasar candi ini adalah punden berundak-undak, namun disesuaikan dengan filosofi Buddha Mahayana. Borobudur bersusun tiga tingkat, yaitu kamadhatu, rupadhatu, dan arupadhatu dengan relief sepanjang 4 km dan arca Buddha berjumlah lebih dari 500 buah. Pada seluruh dinding Borobudur, terdapat sebelas seri relief yang memuat kurang-lebih dari 1.460 buah adegan.\r\n\r\nRelief-relief tersebut memuat berbagai kisah: cerita Buddha, surga dan neraka, dan kisah-kisah dari kitab yang terkenal seperti cerita Karmawibhangga. Namun, sebagian relief lain masih belum dapat diartikan ceritanya. Di atas puncak Borobudur ini terdapat sebuah stupa yang paling besar. Di setiap stupa terdapat patung Budha dalam berbagai posisi.', '', '20171129-Screenshot_2017-11-29-20-38-35-105_com.android.chrome.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '25', NULL, 'candi-budha-di-pulau-jawa', NULL, NULL, NULL),
