(12608, '9', '66', '20171129-66VID-20171129-WA0074.mp4', 'png', 'Tradisi lebaran di kampung', 'Lebaran adalah nama lain dari Hari Raya umat Islam, baik hari raya Idul Fitri maupun hari Raya Idul Adha yang dirayakan setiap tahun atau setiap bulan Syawal setelah sebulan umat Muslim melaksanakan puasa di bulan Ramadan.\r\n\r\nLebaran Idul Fitri\r\nLebaran Idul Fitri atau biasa disebut \"Lebaran Mudik\" saja dilaksanakan ketika hari raya Idul Fitri tiba, orang-orang Islam umumnya saling bersalam-salaman dan bermaaf-maafan dengan tetangganya, juga keluarganya setelah menunaikan Salat Ied.', '', '20171129-Screenshot_2017-11-29-20-50-20-538_com.android.chrome.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '39', NULL, 'tradisi-lebaran-di-kampung', NULL, NULL, NULL),
