(12676, '11', '1321', '20171201-1321TUGAS SEJARAH INDONESIA TENTANG SEJARAH KERAJAAN MAJAPAHIT 640x360 0,94Mbps 2017-12-01 10-39-35.mp4', 'mp4', 'Sejarah Singkat Kerajaan Majapahit', 'Latar Belakang Berdirinya Kerajaan Majapahit\r\nSesudah Singasari mengusir Sriwijaya dari Jawa secara keseluruhan pada tahun 1290 Singasari menjadi kerajaan paling kuat di wilayah tersebut. Hal ini menjadi perhatian Kubilai Khan penguasa Dinasti Yuan di Tiongkok. Ia mengirim utusan yang bernama Meng Chi ke Singhasari yang menuntut upeti. Kertanagara penguasa kerajaan Singasari yang terakhir menolak untuk membayar upeti dan mempermalukan utusan tersebut dengan merusak wajah dan memotong telinganya. Kublai Khan marah dan lalu memberangkatkan ekspedisi besar ke Jawa tahun 1293. Ketika itu Jayakatwang adipati Kediri sudah membunuh Kertanagara. Atas saran Aria Wiraraja, Jayakatwang memberikan pengampunan kepada Raden Wijaya menantu Kertanegara yang datang menyerahkan diri. Raden Wijaya kemudian diberi hutan Tarik. Ia membuka hutan itu dan membangun desa baru. Desa itu dinamai Majapahit nama tersebut diambil dari buah maja yang rasanya “pahit” dari buah tersebut.', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '42', NULL, 'sejarah-singkat-kerajaan-majapahit', NULL, NULL, NULL),
