(12682, '15', '1455', '20171201-1455KERAJAAN DEMAK 640x480 1,26Mbps 2017-11-28 22-21-53.mp4', 'mp4', 'SEJARAH SINGKAT KERAJAAN DEMAK', 'Demak adalah kerajaan Islam pertama di Pulau Jawa. Kerajaan yang didirikan oleh Raden Patah ini pada awalnya adalah sebuah wilayah dengan nama Glagah atau Bintoro yang berada di bawah kekuasaan Majapahit. Majapahit mengalami kemunduran pada akhir abad ke-15. Kemunduran ini memberi peluang bagi Demak untuk berkembang menjadi kota besardan pusat perdagangan. Dengan bantuan para ulama Wali Sanga, Demak berkembang menjadi pusat penyebaran agama Islam di Jawa dan wilayah timur Nusantara.\r\n\r\nDemak didirikan oleh Raden Patah (1500-1518) yang setelah naik takhta bergelar Sultan Alam Akbar al Fatah. Menurut Babad Tanah Jawa, Raden Patah adalah putra Brawijaya V (Raja Majapahit terakhir) dengan putri dari Campa Pada masa pemerintahannya, Demak berkembang pesat. Raden Patah memperkuat armada lautnya sehingga Demak berkembang menjadi negara maritim yang kuat. Dengan kekuatannya itu, Demak mencoba menyerang Portugis yang pada saat itu menguasai Malaka. Demak membantu Malaka karena kepentingannya turut terganggu dengan hadirnya Portugis di Malaka. Namun, serangan itu gagal. Di bidang keagamaan, Raden Patah dibantu Wali Sanga, menampilkan Demak sebagai pusat penyebaran Islam. Raden Patah kemudian membangun sebuah masjid yang megah, yaitu Masjid Agung Demak.', 'smkn2 purwodadi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '5', NULL, 'sejarah-singkat-kerajaan-demak', NULL, NULL, NULL),
(12683, '16', '1977', '20171201-1977Sejarah Candi Cetho 720x480 1,42Mbps 2017-11-30 09-30-17.mp4', 'mp4', 'sejarah candi cetho', 'Sejarah Candi Cetho adalah satu satu candi unik yang harus Anda kunjungi bila berada di Jawa Tengah. Candi Centho terletak di Desa Gumeng, Kabupaten Karanganyar, Jawa Tengah. Candi ini adalah candi bercorak Hindu yang cukup terkenal di Pulau Jawa. Candi Cetho cukup unik karena terletak di dataran tinggi dengan ketinggian sekitar 1400 mdpl. Situs sejarha ini juga memiliki sejarah yang mirip dengan Candi lainnya yang terletak tidak jauh yakni Candi Sukuh. Kedua candi ini terletak di Kabupaten Karanganyar Jawa Tengah. Artikel ini akan membahas secara detail tentang sejarah dari  candi cetho termasuk asal usulnya, penemuannya dan keunikan arsitekturnya.', 'smkn2 purwodadi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '3', NULL, 'sejarah-candi-cetho', NULL, NULL, NULL),
