(12692, '3', '1331', '20171202-1331sejarah masjid agung demak 640x360 0,35Mbps 2017-12-01 17-18-14.mp4', 'mp4', 'Masjid Agung Demak', 'Masjid Agung Demak merupakan Masjid tertua di Pulau Jawa, didirikan Wali Sembilan atau Wali Songo. Lokasi Masjid berada di pusat kota Demak, berjarak ± 26 km dari Kota Semarang, ± 25 km dari Kabupaten Kudus, dan ± 35 km dari Kabupaten Jepara. Masjid ini merupakan cikal bakal berdirinya kerajaan Glagahwangi Bintoro Demak.\r\n\r\n', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '5', NULL, 'masjid-agung-demak', NULL, NULL, NULL),
