(12702, '8', '1384', '20171202-1384Penumpasan G 30 sPKI 720x480 1,42Mbps 2017-12-02 09-50-00.mp4', 'mp4', 'Kronologis penumpasan G 30 s/PKI', 'Operasi penumpasan G 30 S/PKI dimulai sejak tanggal 1 Oktober 1965 sore hari. Gedung RRI pusat dan Kantor Pusat Telekomunikasi dapat direbut kembali tanpa pertumpahan darah oleh satuan RPKAD di bawah pimpinan Kolonel Sarwo Edhi Wibowo, pasukan Para Kujang/328 Siliwangi, dan dibantu pasukan kavaleri. Setelah diketahui bahwa basis G 30 S/PKI berada di sekitar Halim Perdana Kusuma, sasaran diarahkan ke sana.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '4', NULL, 'kronologis-penumpasan-g-30-spki-2', NULL, NULL, NULL),
