(12705, '16', '1979', '20171203-1979voc123 960x540 2,13Mbps 2017-12-02 12-09-50.mp4', 'mp4', 'Datangnya VOC di Indonesia', 'VOC adalah kongsi dagang asal Belanda yang memonopoli aktivitas perdagangan di Asia dan menyatukan perdagangan rempah-rempah dari wilayah timur.\r\n\r\nSebagai sebuah kongsi dagang, VOC memiliki beragam hak istimewa dan kewenangan yang sangat luas. Walau hanya sebuah kongsi dagang saja, VOC didukung penuh oleh negara (Belanda) dan difasilitasi secara istimewa.\r\n\r\nMisalnya VOC boleh memiliki pasukan perang dan mengadakan perjanjian dengan negara lain. Ini juga alasan mengapa VOC sering disebut sebagai negara di dalam negara.\r\n\r\nVOC oleh kalangan orang Indonesia sering juga disebut dengan Kumpeni atau Kompeni. Mengapa ? Karena umumnya mayoritas orang Indonesia lebih mudah dalam pengucapannya (diambil dari kata compagnie). Namun rakyat Nusantara lebih mengenal Kompeni sebagai tentara Belanda bukan sebagai sebuah kongsi dagang.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '4', NULL, 'datangnya-voc-di-indonesia', NULL, NULL, NULL),
