(12785, '3', '1594', '20171206-1594Tak berjudul 960x540 2,13Mbps 2017-12-01 13-18-53.mp4', 'jpg', 'Sejarah singkat candi borobudur', 'candi borobudur merupakan warisan budaya indonesia yang sudah terkenal sampai ke seluruh dunia bangunan ini merupakan candi budha terbesar didunia dan ditetapkan sebagai salah satu warisan budaya dunia oleh UNESCO.bentuknya yang megah dan detail arsitekturnya yang unik membuat semua orang ingin mengunjungi borobudur yang penasaran dengan ceritanya,borobudur mencuri perhatian dunia sejak HC cornelius menemukan lokasinya atas perintah Sir Thomas Stamford Raffles pada tahun 1814.pekerjaan menggali lokasi yang diduga monumen besar kemudian dilanjutkan oleh hotman salah satu pejabat pemerintah belanda yang saat itu para arkeolog berlomba lomba mencari tahu asal usul candi budha terbesar didunia ini\r\n', '-', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '32', NULL, 'sejarah-singkat-candi-borobudur', NULL, NULL, NULL),
