(12812, '1', '2068', '20171207-2068Cara Kerja Komputer (Mikroprocessor) (1).mp4', 'jpg', 'Cara Kerja Komputer (Mikroprocessor)', 'Prinsip kerja komputer cukup mudah untuk dipahami. Komputer sendiri merupakan alat elektronik yang mana memiliki kemampuan melaksanakan tugas-tugas tertentu. Mencakuppenerimaan penginputan data, mengolah data tersebut sesuai programnya sehingga menjadi informasi, menyimpan perintah-perintah dan hasil pengolahan, serta menyediakan output dalam bentuk informasi. Semua proses tersebut dilakukan secara otomatis dan bisa dibilang hanya membutuhkan waktu singkat. Lebih ringkasnya urutan proses kerja komputer yaitu ada input data lalu dibawa ke processor untuk diproses sehingga menghasilkan output. Berikut ulasan lebih lengkapnya mengenai proses kerja suatu perangkat komputer :\r\nInput Device (Perangkat Input)\r\nInput device adalah media atau hardware komputer yang berfungsi untuk memasukkan data ke dalam proses memori komputer. Beberapa perangkat keras yang berfungsi sebagai input diantaranya keyboard, mouse, tombol start, reset pada panel depan CPU, joystik, webcam, dan tombol eject pada CD atau DVD ROM. Untuk lebih jelasnya, saat pengguna atau user mengetikkan kata tertentu pada keyboard, maka kata-kata yang dituliskan tersebut merupakan data yang masuk melalui input device yang siap diproses pada processor.\r\nProcessor (Prosesor)\r\nProcessor adalah alat utama yang berfungsi memproses atau mengelola data dari input yang mana nantinya akan dihasilkan keluaran ke sistem output. Sehingga bisa dibilang processor memiliki peran penting dalam system komputer. Adapun processor yang menjadi salah satu bagian penting dalam prinsip kerja komputer terdiri atas 3 bagian utama. Ketiga bagian utama tersebut yaitu CU, ALU, dan memory unit.\r\n1. CU (Control Unit)\r\nCu atau Control Unit adalah komponen utama processor yang memiliki fungsi utama untuk mengontrol semua perangkat yang disematkan pada perangkat komputer. Sebut saja mulai dari perangkat input hingga perangkat output.\r\n2. ALU (Arithmetic Logic Unit)\r\nALU atau Arithmetic Logic Unit adalah unit aritmetika logika. Salah satu bagian processor ini memiliki fungsi mengolah data aritmatika dan juga data logika. Misalnya operasi penjumlahan, pengurangan, dan lainnya (aritmatika) atau perbandingan (logika). Lebih ringkasnya pada bagian inilah terjadi proses atau prinsip kerja komputer sesungguhnya.\r\n3. Memory Unit\r\nMemory merupakan media penyimpanan data di dalam komputer. Dimana setiap perintah yang digunakan oleh processor sementara akan disimpan di bagian ini. Memory unit diketahui terdiri dari dua macam, yaitu ROM dan RAM. ROM atau Read Only Memory adalah memory yang hanya memungkinkan untuk dibaca saja. Sehingga kegiatan mengubah atau menghapus isi ROM tidak bisa dilakukan. Isi ROM itu sendiri dibutuhkan ketika komputer dinyalakan. ROM yang digunakan sekarang ini pun sudah mengalami perkembangan dan cukup bervariasi jenisnya seperti PROM, RPROM, EPROM, atau EEPROM\r\nSementara RAM atau Random Access Memori. Yaitu memori yang bisa diakses secara acak dan berfungsi guna menyimpan program yang diolah saat komputer menyala. Bila komputer switch off alias mati, maka data tersimpan dalam RAM bisa hilang. RAM sendiri memiliki tujuan mempercepat proses data pada perangkat komputer.\r\nOutput Device (Perangkat Output)\r\nOutput device adalah media atau perangkat komputer yang berfungsi untuk menampilkan atau menghasilkan data dari proses. Jadi bisa dibilang termasuk memiliki peran penting dalam prinsip kerja komputer. Hasil keluaran atau output yang dimaksud dapat berupa softcopy seperti yang ditampilkan layar monitor atau suara, dan bisa pula berupa hardcopy misalnya seperti kertas. Beberapa perangkat yang termasuk output device yaitu monitor, printer, scanner, speaker, headset, dan lainnya.\r\nDalam menjalankan tugas atau kerjanya, sebuah perangkat komputer juga melibatkan setidaknya 3 elemen penting. Ketiga elemen tersebut diantaranya:\r\n1.	Hardware\r\nHardware merupakan perangkat keras. Perangkat keras ini berupa peralatan fisik komputer yang bisa dilihat dan juga dirasakan langsung oleh pengguna komputer\r\n2.	Software\r\nSoftware atau perangkat lunak adalah program komputer yang berfungsi untuk menjalankan kerja sesuai dengan keinginan. Dimana program yang dimaksud ditulis menggunakan bahasa khusus (bahasa pemograman) yang dapat dipahami oleh komputer. Sehingga tak sama seperti hardware, perangkat lunak tidak bisa dirasakan secara langsung.\r\n3.	Brainware\r\nBrainware merupakan user, pengguna, atau sumber daya manusia. Yakni mereka yang terlibat secara langsung dalam penggunaan seperangkat komputer. Sebut saja seperti programmer, sistem analis, user, operator, dan lain sebagainya.\r\nPerlu diketahui, dalam prinsip kerja komputer sebuah perangkat komputer hanya akan bekerja bila menerima perintah-perintah yang dikemas dalam program. Dimana perintah tersebut akan diolah dan diproses oleh komputer di bagian CPU. Adapun mikroprosesor dari CPU hanya akan menggarap perintah yang memang dikenali. Instruksi ini umum disebut instruksi mesin atau instruksi komputer. Sementara sekumpulan fungsi yang bisa digarap oleh CPU dikenal sebagai set instruksi CPU. Perintah atau instruksi yang akan dikerjakan komputer memang tidak sama seperti perintah yang diberikan dalam bahasa manusiawi. Pasalnya komputer hanya mampu memahami perintah sederhana yang dirumuskan secara baik.\r\nDari uraian di atas dapat disimpulkan prinsip kerja dari perangkat komputer diawali dengan memasukkan data dari perangkat input. Baik melalui keyboard, mouse, atau perangkat input lainnya. Selanjutnya data dari input akan diolah sedemikian rupa oleh CPU seperti kebutuhan pengguna menggunakan sistem yang tersimpan dalam memori komputer. Proses pengolahan berlangsung cepat, secepat jeda input dimasukkan dan hasil data ditampilkan. Adapun hasil data yang sudah diolah dan disimpan bisa dilihat melalui output device. Cukup mudah dipahami bukan. Sekian dan semoga ulasan tentang prinsip kerja komputer kali ini bermanfaat.\r\n\r\n\r\n\r\n\r\nSumber : https://www.youtube.com/watch?v=kZnjLIuV2Kg', 'Cara kerja komputer, proses kerja komputer', '20171207-processor.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '31', NULL, 'cara-kerja-komputer-mikroprocessor', NULL, NULL, NULL),
(12813, '8', '2049', '20171207-204912 Months (are in a year) Song.mp4', 'jpg', 'Month of the year', 'Today is FRIDAY\r\nTomorrow will be SATURDAY\r\nYesterday was THURSDAY\r\n\r\nAfter SUNDAY is \r\nMONDAY\r\nBefore MONDAY is\r\nSUNDAY \r\nWhat day is it after SUNDAY?\r\nMONDAY\r\nWhat day is it before MONDAY?\r\nSUNDAY\r\n\r\n\r\n\r\n', 'date, month, year', '20171207-mounth.jpg', NULL, NULL, NULL, NULL, '<p><strong>Days months dates</strong></p>\r\n<ol>\r\n<li><strong> Latar Belakang</strong></li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pentingnya memahami penggunaan hari, bulan dan tanggal dalam bahasa Inggris. Sangatlah berperan penting dalam kehidupan sehari-hari bahkan juga dalam dunia pendidikan. hal ini bisa dijadikan sebuah pembelajaran yang sering digunakan oleh semua para kalangan.</p>\r\n<p>Jumlah hari dalam bahasa Inggris sama dengan bahasa Indonesia, yaitu satu minggu terdiri dari tujuh hari. Nama-nama hari dan bulan dalam bahasa Inggris bisa berguna untuk menambah kosakata. Pada nama bulan dalam bahasa Inggris, nama-namanya tidak jauh berbeda dengan nama-nama bulan dalam bahasa Indonesia. Misalnya saja, bulan Januari bahasa Inggrisnya adalah January. Bahkan ada nama bulan yang dalam bahasa Indonesia sama dengan nama bulan dalam bahasa Inggris, yaitu April, September, dan November. Adapun pada tanggal memiliki aturan tersendiri untuk menuliskannya dalam Bahasa Inggris<strong>. </strong>Selain dalam penulisannya, dalam pengucapannya pun sangatlah perlu diperhatikan.</p>', NULL, NULL, NULL, NULL, 1, '47', NULL, 'month-of-the-year', NULL, NULL, NULL),
