(12854, '15', '2085', '20171208-2085Presenter.mp4', 'mp4', 'Cara membuat kamera', 'Bahan dan Alat :\r\n-Kardus Keras.Usahakan agar kardusnya keras sebagai rangka agar tidak gampang rusak saat di lakukan pembuatan.\r\n- Kardus flexible.Kardus ini hanya sebagai ranka luar agar terllihat menarik atau terlihat memiliki 2 bagian. Dapat juga di buat dari karton.\r\nStik ice cream. Guna dari bahan ini tidak terlalu penting hanya sebagai penghias bagian atas dari kamera.\r\nTali. Tali akan digunakan sebagai gantungan Kamera, Kami menggunakan Tali Sepatu sebagai gantungannya.\r\nKardus Lingkaran. Untuk bagian lensa gunakan kardus lingkaran, dari toko karpet atau tempat lainnya. Ukuran yang digunakan adalah diameter 3,5 inch atau sesuai keinginan.\r\nUntuk bagian lensa dapat dilihat kami menggunakan logam atau kaleng sebagai bagian depannya. Kaleng lem fox kecil yang kosong.\r\n\r\n\r\nPerlengkapan :\r\n\r\nPenggaris\r\nCutter\r\nGunting\r\nCat atau Pilox\r\nLem\r\nSelotip\r\n\r\nCara Pembuatan :\r\n\r\nUkur Bagian – Bagian Yang digunakan sebagai Rangka Utama dari kamera. Untuk bagian depan Ukur bangunan persegi panjang dengan panjang 5 inch dan tinggi 4 inch. Dan bagian samping lebar 2 inch dan tinggi 4 inch.\r\nRekatkan menggunakan lem hingga membentuk kotak sempurna.\r\nLapis kotak asli dengan kardus. Untuk pelapis ukur kardus berukuran tinggi 3,5 inch dan buat hingga menutupi kotak utama (seperti jaket).\r\nKotak2 adalah kotak yang berada di atas sebagai lensa,Untuk membuatnya buatlah kotak kecil dengan panjang 3 inch and tinggi 1 inch. Rekatkan dan buatlah penutup dan tempelkan di depat kotak tsb.\r\nPotong kotang utama 0,5 inch pada tengah bagian atas untuk memasukkan kotak2. Lalu rekatkan kotak2 buatlah agar bagian depan lebih panjang.\r\nBuatlah lingkaran pada bagian depan kotak utama yang telah dilapisi, sesuai dengan lensa luar.\r\nUntuk lensa. buatlah lensa luar denga kardus lingkaran dengan tinggi 2,5 inch dan buatlah lensa dalam dengan kaleng, lapislah kaleng dengan kardus dan masukkan lensa dalam kedalam lensa luar.\r\nRekatkan lensa luar pada lubang tersebut hingga terpasang sempurna.\r\nUntuk pengecatan anda dapat mengecatnya sesuai keinginan anda karena hasil adalah hal anda harapkan.\r\nPasanglah bagian tambahan seperti aksesoris.\r\nUntuk pemasangan tali gunakan tali sepatu dan pasangkan pada samping kamera\r\n', 'Membuat kamera dari kardus', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '5', NULL, 'cara-membuat-kamera-3', NULL, NULL, NULL),
