(12856, '14', '2066', '20171208-2066KOROSI.mp4', 'mp4', 'Korosi', 'Korosi adalah kerusakan atau degradasi logam akibat reaksi redoks antara suatu logam dengan berbagai zat di lingkungannya yang menghasilkan senyawa-senyawa yang tidak dikehendaki. Dalam bahasa sehari-hari, korosi disebut perkaratan. Contoh korosi yang paling lazim adalah perkaratan besi.', 'Proses karat pada besi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '5', NULL, 'korosi-2', NULL, NULL, NULL),
