(12862, '14', '2081', '20171208-2081WIWIN.mp4', 'jpg', 'Cara Membuat Pelangi', 'Pelangi tidak lain adalah busur spektrum warna besar berbentuk lingkaran yang terjadi karena pembiasan cahaya matahari oleh butir-butir air. Ketika cahaya matahari melewati butiran air, ia membias seperti ketika menembus prisma kaca dan keluar menjadi spektrum warna pelangi.\r\nWarna yang dikandung cahaya matahari, yang akan terlihat pada pelangi: merah, jingga, kuning, hijau, biru, nila, dan violet atau dikenal dengan MEJIKUHIBINIU. ... Warna-warna pada pelangi ini tersusun dengan merah di paling atas dan ungu di paling bawah pelangi.', 'Pelangi', '20171208-Wiwin.JPG', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '8', NULL, 'cara-membuat-pelangi-3', NULL, NULL, NULL),
