(12888, '17', '1384', '20171208-1384Penumpasan G 30 sPKI 720x480 1,42Mbps 2017-12-02 09-50-00.mp4', 'mp4', 'kronologis penumpasan G 30 s/PKI', 'Operasi penumpasan G 30 S/PKI dimulai sejak tanggal 1 Oktober 1965 sore hari. Gedung RRI pusat dan Kantor Pusat Telekomunikasi dapat direbut kembali tanpa pertumpahan darah oleh satuan RPKAD di bawah pimpinan Kolonel Sarwo Edhi Wibowo, pasukan Para Kujang/328 Siliwangi, dan dibantu pasukan kavaleri. Setelah diketahui bahwa basis G 30 S/PKI berada di sekitar Halim Perdana Kusuma, sasaran diarahkan ke sana.', '', '20171208-By0XpESCUAE_RtI.jpg', '', '', '', '', '', NULL, NULL, NULL, NULL, 0, '4', NULL, 'kronologis-penumpasan-g-30-spki', NULL, NULL, NULL),
