(12899, '4', '66', '20171211-66jabiru_x264.mp4', 'jpg', 'Pesawat Buatan SMK', 'Jabiru J-430 SMKN 12 Bandung\r\nSTM Penerbangan atau yang kini dikenal dengan SMK Negeri 12 Bandung yang beralamat di Jalan Pajajaran No 92 Bandung menggebrak dunia SMK yang kini sedang marak-maraknya menghasilkan sebuah karya dari Program Studi Terkait. Setelah sukses dalam Pameran Epitech  6 JABAR 2011 yang diselenggarakan di SMKN 2 Tasikmalaya dengan menarik perhatian lebih dari seribu pengunjung. Kini SMKN 12 Bandung  mendapatkan banyak perhatian atas hasil karyanya yaitu merakit pesawat terbang. Pesawat rakitan sekolah yang dulu bernama STM Penerbangan Bandung itu diberi nama Jabiru atau J-430. “Kami punya pesawat Jabiru buatan SMK 12 yang sudah jadi dan sudah dipamerkan,” kata Kepala Dinas Pendidikan Jawa Barat Wahyudin Zarkashy, di Bandung.\r\n\r\nPesawat Terbang yang berhasil dirakit siswa siswi SMKN 12 Bandung ini merupakan tipe pesawat kecil berkapasitas empat sampai enam orang penumpang. Biaya untuk proses ini didapatkan dari bantuan Kepala PSMK Pusat yang ada di Jakarta. Pesawat ini dapat berfungsi  untuk kegiatan pertanian, yakni penyiraman tanaman, penyemprotan pupuk, dan pengusiran hama. “Sasaran pesawat Jabiru adalah daerah-daerah terpencil di Indonesia. Jadi konsep pesawat yang dikembangkan sesuai dengan kepulauan,” kata Wahyudin. \r\n\r\nSaat ini pesawat yang bisa dirakit SMKN 12 Bandung masih satu unit. Namun rencananya akan diproduksi secara massal dan dipasarkan secara nasional karena dipastikan akan sanagt dibutuhkan oleh petani masa depan dalam proses pertanian agar semakin efisien. “Nantinya, para petani masa depan akan mendapat pelayanan seperti di Australia. Nah, kita sisipkan anak-anak SMK supaya bisa merancang dan merawat pesawat-pesawat itu,” tuturnya.\r\n\r\nJika dibandingkan dengan harga pesawat  pasar internasional  di Australia, pesawat Jabiru dengan tipe sejenis dijual dengan harga empat milliar. Namun SMKN 12 Bandung hanya menghabiskan dana sebesar satu milliar untuk satu unitnya. Maka dengan demikian, potensi pasar yang ada akan sangat menjanjikan.Tentunya Pemerintah harus memberikan dukungan agar karya anak bangsa yang satu ini dapat berkembang dan pada akhirnya akan memunculkan karya-karya lain.', 'pesawat, SMKN, ', '20171211-jabiru.jpg', NULL, NULL, NULL, NULL, '<p><br /><br /></p>\r\n<p>The&nbsp;<strong>Jabiru J430</strong>&nbsp;is one model in a large family of two- and four-seat&nbsp;<a title=\"Australia\" href=\"https://en.wikipedia.org/wiki/Australia\">Australian</a>&nbsp;<a title=\"Light aircraft\" href=\"https://en.wikipedia.org/wiki/Light_aircraft\">light aircraft</a>&nbsp;developed as touring aircraft and provided in&nbsp;<a title=\"Homebuilt aircraft\" href=\"https://en.wikipedia.org/wiki/Homebuilt_aircraft\">kit form</a>&nbsp;by&nbsp;<a title=\"Jabiru Aircraft\" href=\"https://en.wikipedia.org/wiki/Jabiru_Aircraft\">Jabiru Aircraft</a>.<sup id=\"cite_ref-KitplanesDec2011_1-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-KitplanesDec2011-1\">[1]</a></sup><sup id=\"cite_ref-WDLA04_2-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA04-2\">[2]</a></sup></p>\r\n<p>&nbsp;</p>\r\n<div id=\"toc\" class=\"toc\">\r\n<div class=\"toctitle\">\r\n<h2>Contents</h2>\r\n&nbsp;<span class=\"toctoggle\">&nbsp;[<a class=\"togglelink\" tabindex=\"0\">hide</a>]&nbsp;</span></div>\r\n<ul>\r\n<li class=\"toclevel-1 tocsection-1\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#Design_and_development\"><span class=\"tocnumber\">1</span><span class=\"toctext\">Design and development</span></a></li>\r\n<li class=\"toclevel-1 tocsection-2\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#Variants\"><span class=\"tocnumber\">2</span><span class=\"toctext\">Variants</span></a></li>\r\n<li class=\"toclevel-1 tocsection-3\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#Specifications_(J430)\"><span class=\"tocnumber\">3</span><span class=\"toctext\">Specifications (J430)</span></a></li>\r\n<li class=\"toclevel-1 tocsection-4\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#References\"><span class=\"tocnumber\">4</span><span class=\"toctext\">References</span></a></li>\r\n<li class=\"toclevel-1 tocsection-5\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#External_links\"><span class=\"tocnumber\">5</span><span class=\"toctext\">External links</span></a></li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>\r\n<h2><span id=\"Design_and_development\" class=\"mw-headline\">Design and development</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: Design and development\" href=\"https://en.wikipedia.org/w/index.php?title=Jabiru_J430&amp;action=edit&amp;section=1\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<p>The J430 is constructed from composite materials. The 31.3&nbsp;ft (9.5&nbsp;m) span&nbsp;<a class=\"mw-redirect\" title=\"High wing\" href=\"https://en.wikipedia.org/wiki/High_wing\">high wing</a>&nbsp;is&nbsp;<a class=\"mw-redirect\" title=\"Strut-braced\" href=\"https://en.wikipedia.org/wiki/Strut-braced\">strut-braced</a>&nbsp;and features&nbsp;<a class=\"mw-redirect\" title=\"Winglets\" href=\"https://en.wikipedia.org/wiki/Winglets\">winglets</a>. The standard engine is the 120&nbsp;hp (89&nbsp;kW)&nbsp;<a title=\"Jabiru 3300\" href=\"https://en.wikipedia.org/wiki/Jabiru_3300\">Jabiru 3300</a>&nbsp;six-cylinder,&nbsp;<a class=\"mw-redirect\" title=\"Horizontally opposed\" href=\"https://en.wikipedia.org/wiki/Horizontally_opposed\">horizontally opposed</a>,&nbsp;<a class=\"mw-redirect\" title=\"Four-stroke\" href=\"https://en.wikipedia.org/wiki/Four-stroke\">four-stroke</a>&nbsp;<a title=\"Aircraft engine\" href=\"https://en.wikipedia.org/wiki/Aircraft_engine\">aircraft engine</a>. The&nbsp;<a title=\"Tricycle landing gear\" href=\"https://en.wikipedia.org/wiki/Tricycle_landing_gear\">tricycle landing gear</a>&nbsp;has optional&nbsp;<a class=\"mw-redirect\" title=\"Wheel pants\" href=\"https://en.wikipedia.org/wiki/Wheel_pants\">wheel pants</a>. The four-seat cabin features a width of 44&nbsp;in (112&nbsp;cm). Construction time from the factory-supplied kit is reported to be 600 hours. Twenty-five examples were completed and flying by the end of 2011.<sup id=\"cite_ref-KitplanesDec2011_1-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-KitplanesDec2011-1\">[1]</a></sup></p>\r\n<h2><span id=\"Variants\" class=\"mw-headline\">Variants</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: Variants\" href=\"https://en.wikipedia.org/w/index.php?title=Jabiru_J430&amp;action=edit&amp;section=2\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\"><a class=\"image\" href=\"https://en.wikipedia.org/wiki/File:JabiruJ450C-GAHU02.JPG\"><img class=\"thumbimage\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/d/d8/JabiruJ450C-GAHU02.JPG/220px-JabiruJ450C-GAHU02.JPG\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/d/d8/JabiruJ450C-GAHU02.JPG/330px-JabiruJ450C-GAHU02.JPG 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d8/JabiruJ450C-GAHU02.JPG/440px-JabiruJ450C-GAHU02.JPG 2x\" alt=\"\" width=\"220\" height=\"165\" data-file-width=\"750\" data-file-height=\"563\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\nJ450</div>\r\n</div>\r\n</div>\r\n<p>data from Jabiru<sup id=\"cite_ref-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-3\">[3]</a></sup></p>\r\n<dl>\r\n<dt>Jabiru J200</dt>\r\n<dt><a title=\"Jabiru J230\" href=\"https://en.wikipedia.org/wiki/Jabiru_J230\">Jabiru J230</a></dt>\r\n<dd>A two-seat version of the J430, designed as a US&nbsp;<a title=\"Light-sport aircraft\" href=\"https://en.wikipedia.org/wiki/Light-sport_aircraft\">light-sport aircraft</a>, with a large baggage compartment behind the seats.<sup id=\"cite_ref-KitplanesDec2011_1-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-KitplanesDec2011-1\">[1]</a></sup><sup id=\"cite_ref-WDLA11_4-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA11-4\">[4]</a></sup><sup id=\"cite_ref-WDLA15_5-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA15-5\">[5]</a></sup></dd>\r\n<dt>Jabiru J250</dt>\r\n<dd>Model similar to the J450, with the back seat removed to give a large cargo area.<sup id=\"cite_ref-WDLA15_5-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA15-5\">[5]</a></sup></dd>\r\n<dt>Jabiru J400</dt>\r\n<dd>Four-seat version powered by a 120&nbsp;hp (89&nbsp;kW)&nbsp;<a title=\"Jabiru 3300\" href=\"https://en.wikipedia.org/wiki/Jabiru_3300\">Jabiru 3300</a>&nbsp;engine and marketed circa 2004.<sup id=\"cite_ref-WDLA04_2-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA04-2\">[2]</a></sup><sup id=\"cite_ref-WDLA15_5-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA15-5\">[5]</a></sup></dd>\r\n<dt>Jabiru J430</dt>\r\n<dd>A four-seater version of the J230 with two seats in the former baggage compartment.<sup id=\"cite_ref-KitplanesDec2011_1-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-KitplanesDec2011-1\">[1]</a></sup><sup id=\"cite_ref-WDLA15_5-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA15-5\">[5]</a></sup></dd>\r\n</dl>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\"><a class=\"image\" href=\"https://en.wikipedia.org/wiki/File:JabiruJ450.jpg\"><img class=\"thumbimage\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/c/c7/JabiruJ450.jpg/220px-JabiruJ450.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/c/c7/JabiruJ450.jpg/330px-JabiruJ450.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/c/c7/JabiruJ450.jpg/440px-JabiruJ450.jpg 2x\" alt=\"\" width=\"220\" height=\"158\" data-file-width=\"1024\" data-file-height=\"736\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\nJabiru J450</div>\r\n</div>\r\n</div>\r\n<dl>\r\n<dt>Jabiru J450</dt>\r\n<dd>Four seat model.<sup id=\"cite_ref-WDLA15_5-4\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA15-5\">[5]</a></sup></dd>\r\n<dt>Jabiru SP</dt>\r\n<dd>Two-seat version for the US light-sport aircraft market, powered by a 120&nbsp;hp (89&nbsp;kW)&nbsp;<a title=\"Jabiru 3300\" href=\"https://en.wikipedia.org/wiki/Jabiru_3300\">Jabiru 3300</a>&nbsp;engine and marketed circa 2004. The SP has a cruise speed of 213&nbsp;km/h (132&nbsp;mph)<sup id=\"cite_ref-WDLA04_2-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA04-2\">[2]</a></sup></dd>\r\n<dt>Jabiru UL</dt>\r\n<dd>Two-seat version for the European&nbsp;<a class=\"mw-redirect\" title=\"Microlight\" href=\"https://en.wikipedia.org/wiki/Microlight\">microlight</a>&nbsp;category powered by a 80&nbsp;hp (60&nbsp;kW)&nbsp;<a title=\"Jabiru 2200\" href=\"https://en.wikipedia.org/wiki/Jabiru_2200\">Jabiru 2200</a>&nbsp;engine and marketed circa 2004. The UL has a cruise speed of 185&nbsp;km/h (115&nbsp;mph)<sup id=\"cite_ref-WDLA04_2-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-WDLA04-2\">[2]</a></sup></dd>\r\n</dl>\r\n<h2><span id=\"Specifications_.28J430.29\"></span><span id=\"Specifications_(J430)\" class=\"mw-headline\">Specifications (J430)</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: Specifications (J430)\" href=\"https://en.wikipedia.org/w/index.php?title=Jabiru_J430&amp;action=edit&amp;section=3\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<p><em>Data from</em>&nbsp;Jabiru Pacific<sup id=\"cite_ref-6\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Jabiru_J430#cite_note-6\">[6]</a></sup></p>\r\n<p><strong>General characteristics</strong></p>\r\n<ul>\r\n<li><strong>Crew:</strong>&nbsp;one</li>\r\n<li><strong>Capacity:</strong>&nbsp;three</li>\r\n<li><strong><a title=\"Payload\" href=\"https://en.wikipedia.org/wiki/Payload\">Payload</a>:</strong>&nbsp;360 kg (792 lb)</li>\r\n<li><strong>Length:</strong>&nbsp;6.55 m (21 ft 5.8 in)</li>\r\n<li><strong><a title=\"Wingspan\" href=\"https://en.wikipedia.org/wiki/Wingspan\">Wingspan</a>:</strong>&nbsp;9.433 m (30 ft 11 in)</li>\r\n<li><strong>Height:</strong>&nbsp;2.40 m (7 ft 10 in)</li>\r\n<li><strong>Wing area:</strong>&nbsp;9.34 m<sup>2</sup>&nbsp;(100.5 sq ft)</li>\r\n<li><strong><a title=\"Manufacturer\'s empty weight\" href=\"https://en.wikipedia.org/wiki/Manufacturer%27s_empty_weight\">Empty weight</a>:</strong>&nbsp;340 kg (748 lb)</li>\r\n<li><strong><a title=\"Maximum takeoff weight\" href=\"https://en.wikipedia.org/wiki/Maximum_takeoff_weight\">Max. takeoff weight</a>:</strong>&nbsp;760 kg (1,675 lb)</li>\r\n<li><strong><a title=\"Aircraft engine\" href=\"https://en.wikipedia.org/wiki/Aircraft_engine\">Powerplant</a>:</strong>&nbsp;1 &times; Jabiru 3300 6 cylinder, 4 stroke piston engine, 89.5 KW (120 hp)</li>\r\n<li><strong>Propellers:</strong>&nbsp;2-bladed Wooden/Composite propeller, 1 per engine\r\n<ul>\r\n<li><strong>Propeller diameter:</strong>&nbsp;1.52 m (5 ft)</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>Performance</strong></p>\r\n<ul>\r\n<li><strong><a title=\"V speeds\" href=\"https://en.wikipedia.org/wiki/V_speeds#Regulatory_V-speeds\">Maximum speed</a>:</strong>&nbsp;256 km/h (160 mph) 138 kn</li>\r\n<li><strong><a title=\"V speeds\" href=\"https://en.wikipedia.org/wiki/V_speeds#Vc\">Cruise speed</a>:</strong>&nbsp;222 km/h (138 mph) 120 kn</li>\r\n<li><strong><a title=\"Stall (fluid mechanics)\" href=\"https://en.wikipedia.org/wiki/Stall_(fluid_mechanics)#Stall_speed\">Stall speed</a>:</strong>&nbsp;92 km/h (57 mph) 50 kn</li>\r\n<li><strong><a title=\"Wing loading\" href=\"https://en.wikipedia.org/wiki/Wing_loading\">Wing loading</a>:</strong>&nbsp;74.7 kg/m<sup>2</sup>. (15.3 lb/(sq ft))</li>\r\n<li><strong><a title=\"Power-to-weight ratio\" href=\"https://en.wikipedia.org/wiki/Power-to-weight_ratio\">Power/mass</a>:</strong>&nbsp;4.3 kg/kW (12.8 lb/hp)</li>\r\n<li><strong>Flight Load Factor:</strong>&nbsp;+ 3.8g - 1.9g</li>\r\n</ul>\r\n<p><br /><br /><a href=\"https://news.detik.com/berita/d-1903888/wow-siswa-smk-jakarta-bisa-membuat-pesawat-jabiru\">https://news.detik.com/berita/d-1903888/wow-siswa-smk-jakarta-bisa-membuat-pesawat-jabiru<br /><br />https://bandung.merdeka.com/halo-bandung/jabiru-pesawat-karya-siswa-smk-yang-tersertifikasi-151211l.html<br /><br /></a></p>\r\n<p><img src=\"http://www.zenithair.com/zodiac/ch650/gif/plans.jpg\" /><br /><br /><br /><img src=\"https://lh5.googleusercontent.com/-lEA6WeVoE74/T12VUsfRHaI/AAAAAAAACfw/4KUAIw7ftZo/s512/Selection_027.jpeg\" /><br /><br />Sumber: Wikipedia.org</p>', NULL, NULL, NULL, NULL, 1, '41', NULL, 'pesawat-buatan-smk', NULL, NULL, NULL),
